INSERT INTO `acamar_api_course` (`id`, `title`, `title_cs`, `title_en`, `title_ru`, `slug`, `short_description`, `short_description_cs`, `short_description_en`, `short_description_ru`, `place`, `place_cs`, `place_en`, `place_ru`, `price`, `price_cs`, `price_en`, `price_ru`, `duration`, `duration_cs`, `duration_en`, `duration_ru`, `content_id`, `meta_keywords`, `slug_cs`, `slug_en`, `slug_ru`, `meta_keywords_cs`, `meta_keywords_en`, `meta_keywords_ru`, `main_banner_id`, `deleted`, `meta_description`, `meta_description_cs`, `meta_description_en`, `meta_description_ru`, `meta_title`, `meta_title_cs`, `meta_title_en`, `meta_title_ru`)
VALUES
	(1,'Курс Тестинг','Kurz Testing','Testing course','Курс Тестинг','testing','В течение пары часов Вы получите \r\nосновные знания в IT-сфере и тестировании программного обеспечения.\r\nПосле введения в теорию Вы можете на практике попробовать работу тестировщиком.','Během pár hodin dostanete základní úvod do oborů IT a testování. \r\n\r\nPo teoretickém úvodu si práci testera rovnou prakticky vyzkoušíte.','In just a few hours you’ll be introduced\r\nto IT and testing on a basic level.\r\nAnd after covering initial theory, you’ll try the tester’s job in practice.\r\n','В течение пары часов Вы получите \r\nосновные знания в IT-сфере и тестировании программного обеспечения.\r\nПосле введения в теорию Вы можете на практике попробовать работу тестировщиком.','Прага','Praha','Prague','Прага',3000,3000,3000,3000,'2 раза по 4 часа','2 × 4 hod','2 x 4 hours','2 раза по 4 часа',43,'','testing','testing-course','testing','','','',42,NULL,'Nauč se pracovat v IT jako tester. Staň se IT expertem a dělej jednu z nejpoptávanějších pozic na trhu.','Nauč se pracovat v IT jako tester. Staň se IT expertem a dělej jednu z nejpoptávanějších pozic na trhu.','','','Základní kurz na pozici Tester — Acamar','Základní kurz na pozici Tester — Acamar','',''),
	(2,'Курс SQL','Kurz SQL','SQL course','Курс SQL','sql','IT-специальности связаны с большим количеством данных.\r\nМы научим Вас в них разбираться и работать с ними.\r\nВы поработаете с базой данных и получите дополнительное преимущество на рынке труда.','IT obory operují se spoustou dat. Naučíme vás se v nich vyznat a pracovat s nimi. Osaháte si zacházení s databázemi a získáte výhodu oproti jiným testerům.\r\n','IT disciplines work with lots of data.\r\nWe’ll show you how to understand and work with it.\r\nYou’ll have an opportunity to work with databases and gain a competitive edge on the labour market.\r\n','IT-специальности связаны с большим количеством данных.\r\nМы научим Вас в них разбираться и работать с ними.\r\nВы поработаете с базой данных и получите дополнительное преимущество на рынке труда.','Прага','Praha','Prague','Прага',3000,3000,3000,3000,'2 раза по 4 часа','2 × 4 hod','2 x 4 hours','2 раза по 4 часа',45,'','zaklady-sql','sql-course','sql','','','',44,NULL,'Nauč se pracovat v IT jako specialista na data v SQL. Staň se IT expertem a dělej jednu z nejpoptávanějších pozic na trhu.','Nauč se pracovat v IT jako specialista na data v SQL. Staň se IT expertem a dělej jednu z nejpoptávanějších pozic na trhu.','','','Kurz práce s SQL databázemi — Acamar','Kurz práce s SQL databázemi — Acamar','',''),
	(3,'Курс Web Services','Kurz Web Services','Web Services course','Курс Web Services','web-services','В качестве тестировщка Вы быстро найдёте ранообразные веб-сервисы. В программировании они очень популярны. \r\nМы объясним Вам принципы HTTP на примерах и Вы погрузитесь в технологии SoapUI.\r\n','Na webové služby jako tester brzy narazíte. V programování znamenají velký trend. Vysvětlíme vám principy HTTP na příkladech a naučíme vás pracovat s nástrojem SoapUI.\r\n\r\n\r\n','As a tester, you’re bound to come across web services soon. They’re a huge trend in coding.\r\nWe’ll introduce and explain the principles of HTTP with examples and you’ll get familiar with SoapUI technology.\r\n\r\n','В качестве тестировщка Вы быстро найдёте ранообразные веб-сервисы. В программировании они очень популярны. \r\nМы объясним Вам принципы HTTP на примерах и Вы погрузитесь в технологии SoapUI.\r\n','Прага','Praha','Prague','Прага',3000,2000,3000,3000,'2 раза по 4 часа','1 × 4 hod','2 x 4 hours','2 раза по 4 часа',47,'','web-services','web-services-course','web-services','','','',46,NULL,'Nauč se pracovat v IT jako tester webových služeb. Staň se IT expertem a dělej jednu z nejpoptávanějších pozic na trhu.','Nauč se pracovat v IT jako tester webových služeb. Staň se IT expertem a dělej jednu z nejpoptávanějších pozic na trhu.','','','Kurz pro testery webových služeb — Acamar','Kurz pro testery webových služeb — Acamar','',''),
	(4,'Kompletní příprava pro testery','Kompletní příprava pro testery','Complete preparation for testers','Полная подготовка для тестировщиков','kompletni-priprava-pro-testery','Nemáte zatím žádné znalosti o IT? Pro vás je určený zvýhodněný plný balíček. Získáte testerské základy i něco navíc. Jako bonus vás připravíme na pohovor do IT firmy.\r\n\r\n\r\n','Nemáte zatím žádné znalosti o IT? Pro vás je určený zvýhodněný plný balíček. Získáte testerské základy i něco navíc. Jako bonus vás připravíme na pohovor do IT firmy.\r\n\r\n\r\n','You don’t know anything about IT yet? We’ve created a three-part course for you.\r\nMaster testing basics and even a bit more. As a bonus, we’ll prepare you for an interview at an IT company.\r\n','У Вас пока нет знаний в IT-области? Для Вас подойдёт обучение, включающее все 3 курса.\r\nВы получите основные знания о тестировании программного обеспечения и дополнительные знания в этой области. В качестве бонуса мы обеспечиваем подготовку на собеседование в IT-фирму.\r\n','Praha','Praha','Prague','Прага',7000,7000,7000,7000,'6 × 4 hod','6 × 4 hod','2 x 4 hours','2 раза по 4 часа',49,'','kompletni-priprava-pro-testery','complete-preparation-testers','polnaya-podgotovka-dlya-testirovshikov','','','',48,NULL,'Komplexní kurz, který Tě připraví na perspektivní kariéru IT specialisty — testera. Staň se žádným IT expertem.','Komplexní kurz, který Tě připraví na perspektivní kariéru IT specialisty — testera. Staň se žádným IT expertem.','','','Nauč se pracovat jako tester od A do Z — Acamar','Nauč se pracovat jako tester od A do Z — Acamar','',''),
	(5,'Hello there','Hello there','','','hello-there','Hi','Hi','','','','','','',NULL,NULL,NULL,NULL,'','','','',80,'','hello-there','','','','','',79,'2019-01-14 10:22:03','','','','','','','','');
