VALUES
	(836,'2019-01-16 16:17:25','Brno','Dle domluvy','Java Integration Developer','<p>Our client is a company,&nbsp;which is Europe\'s leading specialist, electrical and telecommunications retailer and services company. We are looking for Java developer to join their team!</p>','About the team:','<ul>\r\n<li>The Brno Integration team provides end-to-end development, support and testing services across all the company&rsquo;s IT departments. Our production system processes 100s million messages yearly and our daily work only adds to this number</li>\r\n<li>The main purpose of our Integration systems is to create reusable services for all internal and some external systems to allow much needed data exchange in a vast enterprise network</li>\r\n<li>We&rsquo;re now planning to extend our skillset to take over different challenges using other integration platforms our company uses</li>\r\n</ul>','What will be your main responsibilities?','<ul>\r\n<li>Work directly with various Integration platforms and develop services in Java SE using Maven, Git, Artifactory, Jenkins, Linux, Oracle DB, Jira, Confluence + other tools</li>\r\n<li>Be in touch with different enterprise systems (eCommerce, Retail, HR, etc.) and integration technologies (REST, SOAP, JMS, JDBC, SFTP etc.)</li>\r\n<li>Play a key role in developing standards for automation and testing</li>\r\n<li>Cooperate closely with other team members and share successes and blockers</li>\r\n<li>Communicate with our colleagues from different parts of the world</li>\r\n</ul>','What can you achieve in our team?','<ul>\r\n<li>Be a part of enterprise integration</li>\r\n<li>Develop Integration interfaces using Java SE and Agile principles</li>\r\n<li>Get experience in SAP Process Integration, Google Apigee, Apache Kafka, TIBCO Enterprise Message Service and TIBCO BusinessWorks</li>\r\n<li>Get into the integration architecture, concepts and standards</li>\r\n<li>Ownership over interesting and evolving projects/products</li>\r\n</ul>','What we expect from you?','<ul>\r\n<li>2 &ndash; 3 years of experience with Java and object-oriented programming</li>\r\n<li>Experience with XML/XSDs, CSV, JSON standard formats</li>\r\n<li>Experience with versioning systems and build automation</li>\r\n<li>Agile development experience is a big advantage</li>\r\n<li>Development experience with Node.JS is a big advantage</li>\r\n<li>Development experience with Scala language is an advantage</li>\r\n<li>Service Oriented Architecture (SOA) knowledge is an advantage</li>\r\n<li>Apigee development experience is an advantage</li>\r\n<li>TIBCO integration development experience would be appreciated</li>\r\n<li>You need to be willing to learn new things and solve technical problems</li>\r\n<li>You should have an inquiring mind and the ability to do a good research</li>\r\n<li>Ability to express ideas/requirements clearly within the team and across different teams and departments</li>\r\n<li>Your English is sufficient for communication with our overseas colleagues (B2 and higher)</li>\r\n</ul>','','','','','Lucie.Stankova@acamar.cz','Lucie','Staňková','1534404927_Staňková_Lucie.png','https://old2018.acamar.cz/admin/users/images/1534404927_Staňková_Lucie.png','+420 724 271 755','Senior Recruiter',1,'cs','java-integration-developer',828),
	(839,'2018-12-21 11:29:13','Praha','ASAP','Python Developer','<p>Pro na&scaron;eho klienta Proboston Creative hled&aacute;me zku&scaron;en&eacute;ho/nad&scaron;en&eacute;ho Python v&yacute;voj&aacute;ře, kter&yacute; by se pod&iacute;lel na tvorbě mnoha zaj&iacute;mav&yacute;ch projektů.</p>','Představení klienta:','<p>Jsme kreativn&iacute; agentura. Věnujeme se a vyv&iacute;j&iacute;me online aplikace, webov&aacute; ře&scaron;en&iacute;, nějak&yacute; ten intranet nebo cokoli n&aacute;s napadne. Snaž&iacute;me se, aby pr&aacute;ce byla pestr&aacute;. Jsme prim&aacute;rně kreativn&iacute; agentura a stejn&yacute;m principem věnujeme p&eacute;či na&scaron;emu teamu v&yacute;vojařů. Mezi na&scaron;e dlouhodob&eacute; klienty patř&iacute; např. T-Mobile, D.A.S, ALO Diamonds, Vojensk&eacute; lesy a statky, Kofola a jej&iacute; dal&scaron;&iacute; brandy nebo Akademie m&uacute;zick&yacute;ch uměn&iacute; v Praze. V roadmapě m&aacute;me velk&eacute; množstv&iacute; zaj&iacute;mav&yacute;ch projektů, se kter&yacute;mi potřebujeme pomoct.&nbsp;</p>','Koho hledáme a co požadujeme?','<ul>\r\n<li>kolegu, kter&yacute; r&aacute;d chod&iacute; do pr&aacute;ce mezi kolektiv</li>\r\n<li>m&aacute; selsk&yacute; rozum, um&iacute; si poradit a je samostatn&yacute;</li>\r\n<li>um&iacute; m&aacute;knout, když je potřeba protože klient v&scaron;echno před koncem deadlinu změn&iacute; :)</li>\r\n<li>chce pracovat s Djangem / Pythonem&nbsp;a chce m&iacute;t jistotu př&iacute;jmu na full-time</li>\r\n<li>teoretick&eacute; znalosti jako jsou navrhov&eacute; vzory, n&aacute;vrh UI, teoretick&eacute; věci kolem webů</li>\r\n<li>aktivn&iacute; pr&aacute;ce s python a znalost frameworku Django</li>\r\n<li>znalost pr&aacute;ce a principu libovoln&eacute;ho ORM</li>\r\n<li>znalost datab&aacute;ze (ide&aacute;lně MySQL)</li>\r\n<li>z&aacute;kladn&iacute; znalost linuxu, bashe, pr&aacute;ce s přikazovou ř&aacute;dkou</li>\r\n</ul>','Mohlo by se Vám hodit:','<ul>\r\n<li>z&aacute;kladn&iacute; kod&eacute;rsk&eacute; dovednosti (html, css, js)&nbsp;</li>\r\n<li>znalost front-end developmentu jako je React, Vue.js, Angular</li>\r\n<li>zku&scaron;enosti s CSS preprocesoringem&nbsp;</li>\r\n<li>zku&scaron;enost s Gruntem / Gulpem nebo jin&yacute;m podobn&yacute;m n&aacute;strojem</li>\r\n<li>zku&scaron;enosti s GIT a SVN</li>\r\n<li>znalost JS, př&iacute;padn&eacute; nadstavby (ES6, Babel)</li>\r\n</ul>','A co za to?','<ul>\r\n<li>velice agiln&iacute; a friendly v&yacute;voj&aacute;řsk&yacute; team</li>\r\n<li>preferujeme fixn&iacute; pracovn&iacute; dobu, protože je dobr&eacute; m&iacute;t ř&aacute;d a potom klid na soukrom&yacute; život</li>\r\n<li>odpov&iacute;daj&iacute;c&iacute; platov&eacute; ohodnocen&iacute;</li>\r\n<li>čerstv&eacute; ovoce</li>\r\n<li>team, kter&yacute; t&aacute;hne za jeden provaz</li>\r\n<li>nejsme korporace</li>\r\n<li>chceme, aby se u n&aacute;s lid&eacute; c&iacute;tili dobře. I když to může zn&iacute;t jako velk&eacute; kli&scaron;&eacute;, tak pro n&aacute;s je důležit&eacute; aby u n&aacute;s lid&eacute; vydrželi a zůstali</li>\r\n</ul>','Zaujali jsme Vás?','<p>Nev&aacute;hejte se n&aacute;m ozvat. Ide&aacute;lně za&scaron;lete Va&scaron;e aktu&aacute;ln&iacute; CV a my se s V&aacute;mi spoj&iacute;me a domluv&iacute;me detaily.</p>\r\n<p>Tě&scaron;&iacute;me se na V&aacute;s!</p>','','','veronika.benackova@acamar.cz','Veronika','Benáčková','1529585987_Adastra_2018-770.png','https://old2018.acamar.cz/admin/users/images/1529585987_Adastra_2018-770.png','+420 776 254 627','Recruiter',1,'cs','python-developer',822),
	(840,'2018-11-15 00:00:00','Prague','ASAP','Java Fullstack Developer with Angular','<p>Our client is one of the biggest German banks, a global banking and financial services company. The bank offers its clients&nbsp;<strong>retail</strong>&nbsp;and commercial financing services,<strong>&nbsp;investment banking</strong>&nbsp;services, asset management &amp; private banking services.</p>\r\n<p>Currently we are looking for experienced&nbsp;Fullstack Java Developer&nbsp;to extend out Prague team.</p>','Main purpose of the role:','<p>Development of new features and audit requirements on system consisting of web client and backend systems. It is questionnaire/approval workflow tool consisting of 2 parts: Anti Money Laundering Workflow and Account Setup Request Workflow. The AML is the gatekeeper for client interaction and provides a questionnaire to determine who the client is and whether or not is allowed to do business with the client. Output is set up of COKIS or trading system accounts for clients we may interact with.</p>','Requirements:','<p>Must have:</p>\r\n<ul>\r\n<li>Java</li>\r\n<li>UX design focus (PrimeFaces / Angular)</li>\r\n<li>Spring (IoC)</li>\r\n<li>REST, SOAP</li>\r\n<li>Oracle SQL</li>\r\n<li>Hibernate</li>\r\n<li>Maven</li>\r\n<li>Able to understand and maintain really complex system</li>\r\n<li>Independent logical and analytical thinking</li>\r\n<li>Team player, open minded, proactive and good communication skills</li>\r\n<li>English</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Nice to have:</p>\r\n<ul>\r\n<li>Spring Boot</li>\r\n<li>Selenium</li>\r\n<li>Scrum</li>\r\n<li>Linux</li>\r\n</ul>','','','','','','','','','tereza.jarolimkova@acamar.cz','Tereza','Jarolímková','1547127338_teranasirku.png','https://old2018.acamar.cz/admin/users/images/1547127338_teranasirku.png','+420 725 512 351','Senior Recruiter',1,'cs','java-fullstack-developer-with-angular',765),
	(842,'2018-10-19 13:39:21','Pilsen','ASAP','Java Developer – IoT Solutions','<p>Our customer develops solutions for vehicle connectivity, smart mobility and/or remote diagnostics that are used in buses, trucks and passenger cars. Besides that, it develops open and individual concepts that provide intelligent connectivity solutions in telematics, asset tracking, entertainment, diagnostics and engineering.</p>\r\n<p>We seek both Junior and Mid/Senior Java Developers willing to build software solutions in modern technologies within a friendly atmosphere. These software solutions are used worldwide &ndash; from Germany to Hong-Kong and Australia to Sweden.&nbsp;</p>','Responsibilities:','<ul>\r\n<li>Requirement analysis</li>\r\n<li>Solution design and programming</li>\r\n<li>Participation in all phases of development lifecycle</li>\r\n<li>Writing documentation and keeping it up-to-date</li>\r\n</ul>','Required experience:','<ul>\r\n<li>Java SE/2EE</li>\r\n<li>Spring Boot, Hibernate, Docker Swarm</li>\r\n<li>Microsoft Azure, Microservice Architecture, REST API Services</li>\r\n<li>Maven, GIT, Nexus, Jenkins, Jira, SCRUM, Confluence</li>\r\n<li>SQL knowledge</li>\r\n<li>Good English</li>\r\n</ul>','What we would appreciate:','<ul>\r\n<li>NoSQL databases experience</li>\r\n<li>Kubernetes&nbsp;</li>\r\n<li>Active Directory</li>\r\n<li>IoT experience</li>\r\n</ul>','','','','','','','tereza.jarolimkova@acamar.cz','Tereza','Jarolímková','1547127338_teranasirku.png','https://old2018.acamar.cz/admin/users/images/1547127338_teranasirku.png','+420 725 512 351','Senior Recruiter',1,'cs','java-developer-iot-solutions',811),
