	(873,'2019-02-28 11:29:01','Brno','dle domluvy','BI Report Builder','<p>We are looking for candidates to join client\'s BI team in Brno.&nbsp;This role plays a key role in enabling client to meet customer expectations for Business Intelligence solutions, and helps to ensure that new solutions can deliver benefit to their&nbsp;business.</p>','About the team:','<ul>\r\n<li>Our Business Intelligence team is working on comprehensive Microsoft BI/DW solutions, which makes us exceptional on the market with regards to company size, the number of source systems, volume of data and extent of projects.</li>\r\n<li>BI team is mainly working on projects that help to define, implement and hand over to end users - i.e. ticket processing is not what we do!</li>\r\n<li>Within our team you will cooperate with designers, testers, data architects, ETL analysts and two colleagues at the same position</li>\r\n<li>Overall our team in Brno has approx. 20 colleagues</li>\r\n<li>Part of our BI Team is also located in the United Kingdom (business analysts and project manager), so occasional trips to UK are included.</li>\r\n</ul>','What will you do?','<ul>\r\n<li>Develop reports within Microsoft BI Suite</li>\r\n<li>3rd Line support for reporting solution</li>\r\n<li>Provide guidance and expertise in the design of reporting solutions</li>\r\n<li>Become an expert in Microsoft BI reporting toolset</li>\r\n<li>Identify and highlight opportunities to improve reporting and services within the business</li>\r\n</ul>','How do we imagine you?','<ul>\r\n<li>Analytical mind</li>\r\n<li>Strong Microsoft BI experience:<br />-&nbsp; &nbsp; SSAS, SSRS, Power BI<br />-&nbsp; &nbsp; MDX, SQL (must) and DAX (nice to have)<br />-&nbsp; &nbsp; Or long-term experience with other reporting tools</li>\r\n<li>Able to prioritize a varied workload</li>\r\n<li>Customer-focused</li>\r\n<li>Good communication skills in English</li>\r\n<li>Flexibility in working hours to meet project deadlines</li>\r\n</ul>','','','','','','','Lucie.Stankova@acamar.cz','Lucie','Staňková','1534404927_Staňková_Lucie.png','https://old2018.acamar.cz/admin/users/images/1534404927_Staňková_Lucie.png','+420 724 271 755','Senior Recruiter',4,'cs','bi-report-builder',840),
	(876,'2019-01-16 16:17:25','Brno','starting date will be agreed','Java Integration Developer','<p>Our client is a company,&nbsp;which is Europe\'s leading specialist, electrical and telecommunications retailer and services company. We are looking for Java developer to join their team!</p>','About the team:','<ul>\r\n<li>The Brno Integration team provides end-to-end development, support and testing services across all the company&rsquo;s IT departments. Our production system processes 100s million messages yearly and our daily work only adds to this number</li>\r\n<li>The main purpose of our Integration systems is to create reusable services for all internal and some external systems to allow much needed data exchange in a vast enterprise network</li>\r\n<li>We&rsquo;re now planning to extend our skillset to take over different challenges using other integration platforms our company uses</li>\r\n</ul>','What will be your main responsibilities?','<ul>\r\n<li>Work directly with various Integration platforms and develop services in Java SE using Maven, Git, Artifactory, Jenkins, Linux, Oracle DB, Jira, Confluence + other tools</li>\r\n<li>Be in touch with different enterprise systems (eCommerce, Retail, HR, etc.) and integration technologies (REST, SOAP, JMS, JDBC, SFTP etc.)</li>\r\n<li>Play a key role in developing standards for automation and testing</li>\r\n<li>Cooperate closely with other team members and share successes and blockers</li>\r\n<li>Communicate with our colleagues from different parts of the world</li>\r\n</ul>','What can you achieve in our team?','<ul>\r\n<li>Be a part of enterprise integration</li>\r\n<li>Develop Integration interfaces using Java SE and Agile principles</li>\r\n<li>Get experience in SAP Process Integration, Google Apigee, Apache Kafka, TIBCO Enterprise Message Service and TIBCO BusinessWorks</li>\r\n<li>Get into the integration architecture, concepts and standards</li>\r\n<li>Ownership over interesting and evolving projects/products</li>\r\n</ul>','What we expect from you?','<ul>\r\n<li>2 &ndash; 3 years of experience with Java and object-oriented programming</li>\r\n<li>Experience with XML/XSDs, CSV, JSON standard formats</li>\r\n<li>Experience with versioning systems and build automation</li>\r\n<li>Agile development experience is a big advantage</li>\r\n<li>Development experience with Node.JS is a big advantage</li>\r\n<li>Development experience with Scala language is an advantage</li>\r\n<li>Service Oriented Architecture (SOA) knowledge is an advantage</li>\r\n<li>Apigee development experience is an advantage</li>\r\n<li>TIBCO integration development experience would be appreciated</li>\r\n<li>You need to be willing to learn new things and solve technical problems</li>\r\n<li>You should have an inquiring mind and the ability to do a good research</li>\r\n<li>Ability to express ideas/requirements clearly within the team and across different teams and departments</li>\r\n<li>Your English is sufficient for communication with our overseas colleagues (B2 and higher)</li>\r\n</ul>','','','','','Lucie.Stankova@acamar.cz','Lucie','Staňková','1534404927_Staňková_Lucie.png','https://old2018.acamar.cz/admin/users/images/1534404927_Staňková_Lucie.png','+420 724 271 755','Senior Recruiter',1,'en','java-integration-developer',828),
	(877,'2019-02-28 11:29:01','Brno','starting date will be agreed','BI Report Builder','<p>We are looking for candidates to join client\'s BI team in Brno.&nbsp;This role plays a key role in enabling client to meet customer expectations for Business Intelligence solutions, and helps to ensure that new solutions can deliver benefit to their&nbsp;business.</p>','About the team:','<ul>\r\n<li>Our Business Intelligence team is working on comprehensive Microsoft BI/DW solutions, which makes us exceptional on the market with regards to company size, the number of source systems, volume of data and extent of projects.</li>\r\n<li>BI team is mainly working on projects that help to define, implement and hand over to end users - i.e. ticket processing is not what we do!</li>\r\n<li>Within our team you will cooperate with designers, testers, data architects, ETL analysts and two colleagues at the same position</li>\r\n<li>Overall our team in Brno has approx. 20 colleagues</li>\r\n<li>Part of our BI Team is also located in the United Kingdom (business analysts and project manager), so occasional trips to UK are included.</li>\r\n</ul>','What will you do?','<ul>\r\n<li>Develop reports within Microsoft BI Suite</li>\r\n<li>3rd Line support for reporting solution</li>\r\n<li>Provide guidance and expertise in the design of reporting solutions</li>\r\n<li>Become an expert in Microsoft BI reporting toolset</li>\r\n<li>Identify and highlight opportunities to improve reporting and services within the business</li>\r\n</ul>','How do we imagine you?','<ul>\r\n<li>Analytical mind</li>\r\n<li>Strong Microsoft BI experience:<br />-&nbsp; &nbsp; SSAS, SSRS, Power BI<br />-&nbsp; &nbsp; MDX, SQL (must) and DAX (nice to have)<br />-&nbsp; &nbsp; Or long-term experience with other reporting tools</li>\r\n<li>Able to prioritize a varied workload</li>\r\n<li>Customer-focused</li>\r\n<li>Good communication skills in English</li>\r\n<li>Flexibility in working hours to meet project deadlines</li>\r\n</ul>','','','','','','','Lucie.Stankova@acamar.cz','Lucie','Staňková','1534404927_Staňková_Lucie.png','https://old2018.acamar.cz/admin/users/images/1534404927_Staňková_Lucie.png','+420 724 271 755','Senior Recruiter',4,'en','bi-report-builder',840),
	(882,'2019-03-19 13:18:30','Brno','ASAP','DevOps Engineer','<p>Do you want to become part of a retail company that operates in several European markets under different brands? We are looking for DevOps Engineer who will work on one of the largest e-commerce platforms in Europe. The new team member will be responsible not only for continuous integration/delivery tools, developing a maintaining tooling which development teams are using, but also for other activities.</p>','Project description:','<ul>\r\n<li>our team is mainly responsible for continuous integration/delivery tools which ship our code from multiple Git repositories to testing, staging and production environments</li>\r\n<li>another responsibility lies in developing a maintaining tooling which development teams are using on daily basis to speed-up theirs work</li>\r\n<li>we also enable teams to use new technologies that involves exploring, learning, prototyping and sharing the knowledge<br /> - for example, we are currently investigating possibilities of moving our e-commerce platform to the cloud including containerization of components, infrastructure as a code and CI/CD pipelines</li>\r\n</ul>','What we expect:','<ul>\r\n<li>knowledge of Continuous Integration/Delivery patterns in multi-project environment (code + database + configuration). Usage and setup of CI tools &ndash; Bamboo, Jenkins, Team City</li>\r\n<li>DevOps mindset is a plus &ndash; cooperation, knowledge sharing, tools</li>\r\n<li>experience with virtualized environment &ndash; Docker</li>\r\n<li>experience with any cloud solution is a plus &ndash; AWS, Azure, GCP</li>\r\n<li>knowledge of any programming language (preferably PHP/Python), OOP principles</li>\r\n<li>knowledge of Atlassian tools is a plus &ndash; Bamboo, Stash, Jira, Confluence</li>\r\n<li>English spoken and written</li>\r\n</ul>','Job description:','<ul>\r\n<li>automation and enhancement of all aspects of the current release process</li>\r\n<li>enhancement and further integration of automated testing process into the release process</li>\r\n<li>helping introduction of new technologies to the platform from application point of view (PHP upgrade, migration and virtualization of both production and non-production environments)</li>\r\n</ul>','What we offer:','<ul>\r\n<li>modern office right in the city centre with an amazing terrace</li>\r\n<li>chill out space (Playstation 3,4; Wii &hellip;), relax room, table football</li>\r\n<li>home office (usually 2 days per months, always depends on agreenment)</li>\r\n<li>plenty of social events and charity activities (boat party, regular volleyball session, runners club, summer BBQ, Halloween concert and much more)</li>\r\n</ul>\r\n<p>Do you think your experience match this position? Or do you miss something that we require but still would be very interested? Let&rsquo;s get in touch and see if it could work out&hellip;</p>','','','','','tereza.jarolimkova@acamar.cz','Tereza','Jarolímková','1547127338_teranasirku.png','https://old2018.acamar.cz/admin/users/images/1547127338_teranasirku.png','+420 725 512 351','Senior Recruiter',8,'cs','devops-engineer',846),
	(883,'2019-03-19 13:18:30','Brno','ASAP','DevOps Engineer','<p>Do you want to become part of a retail company that operates in several European markets under different brands? We are looking for DevOps Engineer who will work on one of the largest e-commerce platforms in Europe. The new team member will be responsible not only for continuous integration/delivery tools, developing a maintaining tooling which development teams are using, but also for other activities.</p>','Project description:','<ul>\r\n<li>our team is mainly responsible for continuous integration/delivery tools which ship our code from multiple Git repositories to testing, staging and production environments</li>\r\n<li>another responsibility lies in developing a maintaining tooling which development teams are using on daily basis to speed-up theirs work</li>\r\n<li>we also enable teams to use new technologies that involves exploring, learning, prototyping and sharing the knowledge<br /> - for example, we are currently investigating possibilities of moving our e-commerce platform to the cloud including containerization of components, infrastructure as a code and CI/CD pipelines</li>\r\n</ul>','What we expect:','<ul>\r\n<li>knowledge of Continuous Integration/Delivery patterns in multi-project environment (code + database + configuration). Usage and setup of CI tools &ndash; Bamboo, Jenkins, Team City, &hellip;</li>\r\n<li>DevOps mindset is a plus &ndash; cooperation, knowledge sharing, tools, &hellip;</li>\r\n<li>experience with virtualized environment &ndash; Docker, &hellip;.</li>\r\n<li>experience with any cloud solution is a plus &ndash; AWS, Azure, GCP</li>\r\n<li>knowledge of any programming language (preferably PHP/Python), OOP principles</li>\r\n<li>knowledge of Atlassian tools is a plus &ndash; Bamboo, Stash, Jira, Confluence</li>\r\n<li>English spoken and written</li>\r\n</ul>','Job description:','<ul>\r\n<li>automation and enhancement of all aspects of the current release process</li>\r\n