	(884,'2019-03-21 17:08:56','Prague','starting date will be agreed','Recruiter for Russian-speaking markets','<p>We&rsquo;re not a corporation tied up by rules. But we&rsquo;re not a bunch of hipsters having dogs and swings all over the place either. <strong>We are a small team based in the Czech Republic working for international companies.</strong></p>','THE RECRUITER WE ARE LOOKING FOR:','<ul>\r\n<li>It&rsquo;s a person natural at dealing with people that knows various human characters, <strong>doesn\'t drag emotions into the dealings</strong> and is persistent in achieving goals.</li>\r\n<li>It&rsquo;s a mindful and organized professional who knows that <strong>matching the requirements of our clients with the needs of the professionals isn&rsquo;t a job done on hourly basis</strong>.</li>\r\n<li>He or she also knows that<strong> being kind to everybody always pays off</strong> because there is little people in the world who meet and recommend each other all the time.</li>\r\n<li>Last but not least, a recruiter of our kind <strong>always attempts to find a reasonable solution</strong> to any problematic situation.&nbsp;</li>\r\n</ul>\r\n<p><strong>There are 2 typical profiles we are looking for&hellip;</strong>&nbsp;</p>\r\n<ul>\r\n<li><strong>Seasoned Recruiter</strong>, preferably someone who knows the ins and outs about the Russian-speaking market reaching beyond just Moscow. We operate in Russia from Novosibirsk to Kaliningrad as well as in other countries such as Belarus, Kazakhstan and others &ndash; except Ukraine. We&rsquo;re ready to relocate such a pro to Prague. But we are open to discuss a form of cooperation based on a shuttle system as well.</li>\r\n<li><strong>Open-minded type without previous experience in recruiting</strong>, as long as he/she is knowledgeable of the market. We are more than well suited for passing on the craft. All we need is someone with a humble personality, urge to absorb information and attentiveness to detail.</li>\r\n</ul>','WHO WE ARE AND WHAT TO EXPECT FROM US:','<ul>\r\n<li>With less than a dozen of employees, who are mostly not formally educated Recruiters, we&rsquo;ve managed to break through international borders.<strong> We\'re based in the Czech Republic but work for large corporations, helping them to set up R&amp;D centers</strong> in areas related to Industry 4.0, Automotive, IoT or Banking.</li>\r\n<li><strong>We find and relocate Eastern European Developers, Analysts and QA Specialists </strong>who can boast with the best education, background, experience and problem-solving attitude.</li>\r\n<li>Yet we don&rsquo;t perceive the specialists to be a <em>resource</em>. <strong>We care deeply about their needs as well as professional ambitions and offer them only matching opportunities.</strong> Quite often getting involved in the relocation beyond the professional essentials.</li>\r\n</ul>','WHAT SHOULD YOU KNOW ABOUT US:','<ul>\r\n<li>We don&rsquo;t have fixed working hours&hellip; or material benefits.</li>\r\n<li>We genuinely enjoy working together, meeting every day in our office located in the most sought-after part of the city.</li>\r\n<li>We value having our work done on time and spending the rest of the day on our own.</li>\r\n<li>We cherish a culture where everybody can participate and develop the company.</li>\r\n<li>We all drink alcohol and eat meat. We are not against non-drinkers, vegetarians or vegans. We&rsquo;re just not sure they would be happy around us.</li>\r\n</ul>','WHAT WE OFFER:','<ul>\r\n<li>An opportunity to make a decent living while realizing one&rsquo;s potential by operating in a demanding field.<strong> The remuneration is pretty straightforward:</strong>\r\n<ul>\r\n<li><strong>The basic salary</strong> that enables us to pay the bills and save something off for less fortunate times that might come.</li>\r\n<li><strong>A bonus</strong> when we deserve it. It depends on the number of candidates we manage to deliver on our projects and the engagement in the internal operational or developmental activities.</li>\r\n</ul>\r\n</li>\r\n<li>This approach is fully transparent and aligns with our effort to move the company forward by ourselves. Because we are the ones who know the company best, right?</li>\r\n</ul>\r\n<p><strong>Sounds like an interesting opportunity to you?&nbsp;</strong><strong>Get in touch with us and let&rsquo;s discuss the details.</strong></p>','WHAT ARE THE NEXT STEPS:','<ul>\r\n<li>We will meet in person several times.</li>\r\n<li>In between, we might ask you to complete some assignments.</li>\r\n<li>We will also test your professional and language skills as well as problem solving capabilities.</li>\r\n<li>In case you&rsquo;re located abroad, you&rsquo;ll need to take a trip or two to Prague &ndash; that we will assist you with arranging, of course.</li>\r\n</ul>','','','tereza.jarolimkova@acamar.cz','Tereza','Jarolímková','1547127338_teranasirku.png','https://old2018.acamar.cz/admin/users/images/1547127338_teranasirku.png','+420 725 512 351','Senior Recruiter',8,'cs','recruiter-for-russian-speaking-markets',847),
