	(886,'2019-03-25 15:00:35','Praha - Karlín ','Dle dohody','React developer ','<p>Na&scaron;e mateřsk&aacute; společnost Adastra je mezin&aacute;rodn&iacute; technologicko-konzultačn&iacute; společnost, kter&aacute; vyrostla na dod&aacute;v&aacute;n&iacute; DWH a BI ře&scaron;en&iacute;. Do skl&aacute;dačky kompetenc&iacute; ale postupně přibyly dal&scaron;&iacute; oblasti jako aplikačn&iacute; v&yacute;voj, uměl&aacute; inteligence, machine learnig nebo IoT.</p>\r\n<p>V současnosti roz&scaron;iřuje t&yacute;m SW factory, kter&yacute; se věnuje pr&aacute;vě aplikačn&iacute;mu v&yacute;voji a hled&aacute; React developera na různ&eacute; projekty.</p>','Co budete mít na starosti:','<p>SW factory pracuje na různ&yacute;ch projektech pro tuzemsk&eacute; i zahraničn&iacute; z&aacute;kazn&iacute;ky zejm&eacute;na v asijsk&yacute;ch zem&iacute;ch. Ve va&scaron;em př&iacute;padě se bude jednat hlavně o v&yacute;voj front-endu webov&yacute;ch aplikac&iacute; v React, Redux.</p>\r\n<p>Čemu se např&iacute;klad nyn&iacute; v SW factory věnuj&iacute;?&nbsp;Klientovi z oblasti automotive např&iacute;klad pom&aacute;haj&iacute; s n&aacute;strojem pro pl&aacute;nov&aacute;n&iacute; v&yacute;roby v r&aacute;mci dodržen&iacute; legislativn&iacute;ch emisn&iacute;ch norem. Pro zahraničn&iacute; finančn&iacute; instituce zase pom&aacute;haj&iacute; s customizac&iacute; a implementac&iacute; onboardingov&eacute; platformy.</p>','Tato role je pro vás, pokud: ','<ul>\r\n<li>R&aacute;di programujete v technologi&iacute;ch JavaScript, React.js, Redux, TypeScript...</li>\r\n<li>Pracujete s Jira, Git, Bitbucket.</li>\r\n<li>Se bez probl&eacute;mu domluv&iacute;te v angličtině jak s kolegy, tak se z&aacute;kazn&iacute;kem.</li>\r\n<li>Upřednostňujete agiln&iacute; př&iacute;stup a pr&aacute;ci v men&scaron;&iacute;ch t&yacute;mech.</li>\r\n</ul>','Zaujali jsme vás?  ','<p>Nev&aacute;hejte a po&scaron;lete n&aacute;m Va&scaron;e CV nebo odkaz na LI. Spoj&iacute;me se s V&aacute;mi a domluv&iacute;me se na dal&scaron;&iacute;m postupu.&nbsp;</p>','','','','','','','Marta.maresova@adastragrp.com','Marta','Marešová','1529658364_KopeckáMartafotonašířku.png','https://old2018.acamar.cz/admin/users/images/1529658364_KopeckáMartafotonašířku.png','+420 601 103 135','Recruiter',1,'cs','react-developer',848),
