	(903,'2019-05-15 00:00:00','Praha 2 - Karlovo náměstí','ASAP','BI Consultant','<p>Chtěl by ses pod&iacute;let na rozvoji, &uacute;držbě a aktualizaci reportů u jednoho z&nbsp;na&scaron;ich z&aacute;kazn&iacute;ků? Jestliže m&aacute;&scaron; znalost pokročil&eacute;ho reportingu v&nbsp;excelu, nejsou ti ciz&iacute; ani reportingov&eacute; n&aacute;stroje a v&iacute;&scaron; o problematice OLAP kostek, pak to pojď s&nbsp;n&aacute;mi zkusit&hellip;</p>','Popis projektu:','<ul>\r\n<li>&uacute;držba, aktualizace a rozvoj reportů naprogramovan&yacute;ch v&nbsp;excelu</li>\r\n<li>n&aacute;vrh automatizace těchto reportů a n&aacute;sledn&eacute; převeden&iacute; do vizu&aacute;ln&iacute; podoby pomoc&iacute; vhodn&eacute;ho n&aacute;stroje</li>\r\n</ul>','Co očekáváme: ','<ul>\r\n<li>dobr&aacute; znalost pr&aacute;ce v&nbsp;excelu</li>\r\n<li>znalost pokročil&eacute;ho reportingu v excelu</li>\r\n<li>znalost reportingov&yacute;ch n&aacute;strojů v&yacute;hodou</li>\r\n<li>znalost problematiky OLAP kostek v&yacute;hodou</li>\r\n<li>znalost česk&eacute;ho jazyka, angličtina alespoň na &uacute;rovni psan&eacute; a čten&eacute; dokumentace</li>\r\n</ul>','Náplň práce:','<ul>\r\n<li>tvorba a &uacute;prava reportů v&nbsp;excelu, kter&eacute; jsou napojeny na OLAP kostky</li>\r\n<li>pod&iacute;len&iacute; se na ostatn&iacute;ch činnostech DWH BI teamu</li>\r\n</ul>\r\n<p>Nev&aacute;hej n&aacute;m zaslat svůj aktualizovan&yacute; životopis, r&aacute;di si s&nbsp;tebou zavol&aacute;me, potk&aacute;me se a popov&iacute;d&aacute;me o detailech.</p>','','','','','','','Lucie.Stankova@acamar.cz','Lucie','Staňková','1534404927_Staňková_Lucie.png','https://old2018.acamar.cz/admin/users/images/1534404927_Staňková_Lucie.png','+420 724 271 755','Senior Recruiter',4,'cs','bi-consultant',841),
	(905,'2019-05-20 19:15:41','Praha','ideálně ASAP','Oracle admin','<p>Do men&scaron;&iacute;ho IT t&yacute;mu zdravotnick&eacute;ho zař&iacute;zen&iacute; hled&aacute;me Oracle administr&aacute;tora!&nbsp;</p>','Zodpovědnosti a náplň práce:','<ul>\r\n<li>Spr&aacute;va datab&aacute;z&iacute; Oracle 12 &ndash; monitorov&aacute;n&iacute; v&yacute;konu, &uacute;držba parametrů, laděn&iacute; dotazů, spr&aacute;va indexů, &uacute;držba velikosti tabulek</li>\r\n<li>Pomoc při laděn&iacute; PL/SQL scriptů</li>\r\n<li>Ře&scaron;en&iacute;, identifikov&aacute;n&iacute; a odstraňov&aacute;n&iacute; vznikl&yacute;ch probl&eacute;mů a nedostatků</li>\r\n<li>Spolupr&aacute;ce při nasazov&aacute;n&iacute; nov&yacute;ch verz&iacute; aplikace &ndash; jednor&aacute;zov&eacute; &uacute;držby datab&aacute;ze, zv&yacute;&scaron;en&yacute; dohled</li>\r\n<li>Instalace, &uacute;držba a aktualizace SW pro v&yacute;voj i produkčn&iacute; prostřed&iacute;</li>\r\n<li>Definice a spr&aacute;va př&iacute;stupov&yacute;ch pr&aacute;v (př&iacute;stupy na disky, př&iacute;stupy do datab&aacute;ze)</li>\r\n<li>&Uacute;držba dat na disku</li>\r\n</ul>','','','','','','','','','','','Lucie.Stankova@acamar.cz','Lucie','Staňková','1534404927_Staňková_Lucie.png','https://old2018.acamar.cz/admin/users/images/1534404927_Staňková_Lucie.png','+420 724 271 755','Senior Recruiter',6,'cs','oracle-admin',861),
	(906,'2019-05-23 17:00:09','Prague','ASAP','Software Engineering - Java Developer','<p>We are looking for Java Developer to join a Bizz Dev Ops team responsible for a bunch of IT applications dealing with the securities process: starting with the securities order from our clients to different exchanges over settlement to execution. Also, Asset Services as corporates actions, dividend payments, tax issues etc. are part of&nbsp;the new agile Securities Process Cluster.</p>\r\n<p>Your tasks for the first 9 month are focused on implementing requirements for the IT application COAC. This application receives notification of Corporate Action and Income events from Data providers (currently Bloomberg, Telekurs, SWIFT and, indirectly through KVneu/ZIKADE, WM Data). COAC creates a Master copy of the event and provides this information to various front office systems.</p>','What will be your main responsibilities?','<ul>\r\n<li>You are developing new functionality based on the requirements from Project SIRIUS in the existing COAC application</li>\r\n<li>You will support incident resolution and bug fixing and support the test and development team</li>\r\n<li>You will be working in a agile team setup, meaning the team includes business domain colleagues, business analysts, architects, developers and operating.</li>\r\n<li>Participate in scrum ceremonies (Daily, Planning, Review, Retro) using VidCo/Telco or &ndash; exceptionally &ndash; in person.</li>\r\n</ul>','What we expect from you?','<ul>\r\n<li>Good analytic thinking with attention to details to solve problems</li>\r\n<li>Proactively driving projects and tasks to deliver results</li>\r\n<li>Customer orientation and ownership attitude for the assigned responsibilities to deliver results in time and in line with the clients need</li>\r\n<li>Excellent collaboration and communication skills</li>\r\n<li>High flexibility and adaptability to fast changing environment</li>\r\n<li>Good team player with high ability to work in cross-locational and international teams</li>\r\n</ul>','Technologies:','<ul>\r\n<li>JAVA 5 &ndash; 8</li>\r\n<li>Struts 1.3</li>\r\n<li>Openadaptor</li>\r\n<li>JSP</li>\r\n<li>JDBC</li>\r\n<li>EclipseLink</li>\r\n<li>PrimeFaces</li>\r\n<li>Web Services</li>\r\n<li>Database (Sybase ASE Version 15 and 16, SQL, Transact-SQL)</li>\r\n</ul>','','','','','','','Lucie.Stankova@acamar.cz','Lucie','Staňková','1534404927_Staňková_Lucie.png','https://old2018.acamar.cz/admin/users/images/1534404927_Staňková_Lucie.png','+420 724 271 755','Senior Recruiter',1,'cs','software-engineering-java-developer',862),
	(907,'2019-05-23 17:00:09','Prague','ASAP','Software Engineering - Java Developer','<p>We are looking for Java Developer to join a Bizz Dev Ops team responsible for a bunch of IT applications dealing with the securities process: starting with the securities order from our clients to different exchanges over settlement to execution. Also, Asset Services as corporates actions, dividend payments, tax issues etc. are part of&nbsp;the new agile Securities Process Cluster.</p>\r\n<p>Your tasks for the first 9 month are focused on implementing requirements for the It application COAC. This application receives notification of Corporate Action and Income events from Data providers (currently Bloomberg, Telekurs, SWIFT and, indirectly through KVneu/ZIKADE, WM Data). COAC creates a Master copy of the event and provides this information to various front office systems.</p>','What will be your main responsibilities?','<ul>\r\n<li>You are developing new functionality based on the requirements from Project SIRIUS in the existing COAC application</li>\r\n<li>You will support incident resolution and bug fixing and support the test and development team</li>\r\n<li>You will be working in a agile team setup, meaning the team includes business domain colleagues, business analysts, architects, developers and operating.</li>\r\n<li>Participate in scrum ceremonies (Daily, Planning, Review, Retro) using VidCo/Telco or &ndash; exceptionally &ndash; in person.</li>\r\n</ul>','What we expect from you?','<ul>\r\n<li>Good analytic thinking with attention to details to solve problems</li>\r\n<li>Proactively driving projects and tasks to deliver results</li>\r\n<li>Customer orientation and ownership attitude for the assigned responsibilities to deliver results in time and in line with the clients need</li>\r\n<li>Excellent collaboration and communication skills</li>\r\n<li>High flexibility and adaptability to fast changing environment</li>\r\n<li>Good team player with high ability to work in cross-locational and international teams</li>\r\n</ul>','Technologies:','<ul>\r\n<li>JAVA 5 &ndash; 8</li>\r\n<li>Struts 1.3</li>\r\n<li>Openadaptor</li>\r\n<li>JSP</li>\r\n<li>JDBC</li>\r\n<li>EclipseLink</li>\r\n<li>PrimeFaces</li>\r\n<li>Web Services</li>\r\n<li>Database (Sybase ASE Version 15 and 16, SQL, Transact-SQL)</li>\r\n</ul>','','','','','','','Lucie.Stankova@acamar.cz','Lucie','Staňková','1534404927_Staňková_Lucie.png','https://old2018.acamar.cz/admin/users/images/1534404927_Staňková_Lucie.png','+420 724 271 755','Senior Recruiter',1,'en','software-engineering-java-developer',862),
