	(912,'2019-06-17 18:14:12','Praha','1.7.2019','Tester','<p>Pro na&scaron;eho klienta z oblasti telco aktu&aacute;lně hled&aacute;me testera do Online agiln&iacute;ho t&yacute;mu!</p>','Co od tebe očekáváme?','<ul>\r\n<li>Zku&scaron;enosti s testov&aacute;n&iacute;m v online světě</li>\r\n<li>Zku&scaron;enosti s agile</li>\r\n<li>Javascript, React, PHP</li>\r\n<li>SOAP UI, SQL basics</li>\r\n<li>Samostatnost, zodpovědn&yacute; př&iacute;stup</li>\r\n<li>Znalost anglick&eacute;ho jazyka</li>\r\n</ul>','Bylo by bezva, kdybys měl/a...','<ul>\r\n<li>Zku&scaron;enosti s automatizac&iacute; (Java, Selenium)&nbsp;</li>\r\n<li>UX zku&scaron;enosti</li>\r\n<li>Zku&scaron;enosti s integračn&iacute;mi testy&nbsp;</li>\r\n</ul>','','','','','','','','','Lucie.Stankova@acamar.cz','Lucie','Staňková','1534404927_Staňková_Lucie.png','https://old2018.acamar.cz/admin/users/images/1534404927_Staňková_Lucie.png','+420 724 271 755','Senior Recruiter',5,'cs','tester',866),
	(915,'2019-06-21 15:17:09','Brno','starting date will be agreed','PHP Developer','<p>For our client, we are looking for a PHP developer to join multicultural development team working on an SOA e-commerce platform which serves as basis for one of the most popular online shops with electronics in UK. The platform handles more than 7,000,000 unique visitors per day and processes 8 orders per second during the most busy season.<br />They are continuously improving the platform and looking for new challenges. Currently they are working on complete automation of checkout process, they focus on test automation improvements and they are preparing for next steps in continuous integration.<br />They are agile with the vision of becoming a multichannel leader on the EU market.</p>','What will your job be about?','<ul>\r\n<li>You will work on one of the biggest e-commerce platforms in Europe</li>\r\n<li>Facing a lot of interesting business and technical tasks will be your daily job, we are in a close touch with out UK colleagues</li>\r\n<li>Agile environment &ndash; Scrum and Kanban</li>\r\n<li>Possibility to use PhpStorm IDE</li>\r\n<li>You can shine in technologies: PHP, PL/SQL, JS, CSS, Varnish, RabbitMQ, Couchbase,..</li>\r\n<li>Frameworks and libraries: Symphony, CodeIgniter, Reacr&amp;Redux,...</li>\r\n<li>Tools we use: AppDynamics, Jira, Confluence, Bamboo, Stash,...</li>\r\n</ul>','How do we imagine you?','<ul>\r\n<li>You have experience with PHP, OOP and any of PHP frameworks</li>\r\n<li>You have met with SVN/GIT and use framework (Nette, CodeIgniter)</li>\r\n<li>MySQL or Oracle experience</li>\r\n<li>You are experienced also in other web technologies (HTML, CSS, JS)</li>\r\n<li>You will take part in our occasional hackatons, play the Playstation or relax in the chill-out room</li>\r\n<li>Your English is proper for communication with our foreign colleagues</li>\r\n</ul>','Extra mile for us:','<ul>\r\n<li>Experience with Atlassian tools (Jira, Stash, Bamboo, Confluence)</li>\r\n<li>You have experience or knowledge of design patterns</li>\r\n<li>You can met also Couchbase, RabbitMQ, Varnish</li>\r\n<li>Linux/Unix and Bash scripting is familiar to you</li>\r\n<li>You are experienced in test automation (unit testing and function testing as well)</li>\r\n</ul>','','','','','','','Lucie.Stankova@acamar.cz','Lucie','Staňková','1534404927_Staňková_Lucie.png','https://old2018.acamar.cz/admin/users/images/1534404927_Staňková_Lucie.png','+420 724 271 755','Senior Recruiter',1,'cs','php-developer',869),
	(916,'2019-06-26 14:42:23','Brno','starting date will be agreed','JavaScript Developer','<p>For our client, we are looking for a JavaScript developer to join multicultural development team working on an SOA e-commerce platform which serves as basis for one of the most popular online shops with electronics in UK. The platform handles more than 7,000,000 unique visitors per day and processes 8 orders per second during the most busy season.<br />They are continuously improving the platform and looking for new challenges. Currently they are working on complete automation of checkout process, they focus on test automation improvements and they are preparing for next steps in continuous integration.<br />They are agile with the vision of becoming a multichannel leader on the EU market.</p>','What will your job be about?','<p>▪ Development and maintenance of high quality performant Front End of one of the largest e-commerce platform in Europe<br />▪ Responsibility for technical design, analysis and delivery of UI parts of the projects<br />▪ Close collaboration with UX, PHP, testing and infrastructure teams<br />▪ L3 production support (incident resolution &amp; support requests resolution)<br />▪ Participation on a platform upgrade project, bringing new technologies to life</p>','How do we imagine you?','<p>▪ Expert knowledge of JS/CSS/HTML<br />▪ Strong experience with one of the following frameworks / libraries: React, Vue.js, Angular, RxJS<br />▪ Familiarity with responsive and cross-browser webdesign<br />▪ Knowledge of Front End Tooling &ndash; Node.js, npm, Webpack<br />▪ Knowledge of version control system (preferably GIT)<br />▪ Ability to communicate in English<br />▪ Awareness of agile principles and tools (SCRUM)<br />▪ Proactive approach and willingness to learn new technologies</p>','Bonus points for you may be:','<p>▪ E-commerce platform development experience<br />▪ Junior experience with PHP / Python (or any other scripting/procedural) language and object-oriented programming<br />▪ Knowledge of scaled web applications (CDN, caching, reverse proxies,&hellip;)<br />▪ Experience on big production/high traffic website (ideally a transactional retail website)<br />▪ Experience of working with teams in multiple countries</p>','','','','','','','Gabriela.Skalova@acamar.cz','Gabriela','Skálová','1534405240_Gabriela_Skalova.png','https://old2018.acamar.cz/admin/users/images/1534405240_Gabriela_Skalova.png','+420 775 368 490','Senior recruiter',1,'cs','javascript-developer',870),
	(917,'2019-06-27 10:16:29','Praha - Karlín','Dohodou','','','','','','','','','','','','','','','nicole.wiedermannova@adastragrp.com','Nicole','Wiedermannová','1559812167_Nicole.Wiedermannová.png','https://old2018.acamar.cz/admin/users/images/1559812167_Nicole.Wiedermannová.png','+420 702 248 987 ','Recruiter',8,'cs','',871);
