	(34,'Office Assistant','Veronika Benáčková','veronika.benackova@acamar.cz','Klára','Kolaříková','kolarikovaklara1@gmail.com','+420724685206','cv/62f108c6102d6512023c2c1791e1b74c/ŽIVOTOPIS.docx','','Vážená paní Benáčková,\r\n\r\nse zájmem o pozici Office Assistant, jsem se rozhodla zareagovat na Váš inzerát, který splňuje mojí představu o pestrém, dlouhodobém a stabilním zaměstnání, s možností dalšího osobního rozvoje.\r\nVelice ráda bych zde uplatnila své, převážně administrativní a komunikační dovednosti, ať už v českém, tak i v anglickém jazyce. Jinak preferuji samostatnou organizaci jednotlivých úkonů, vyplývající z pracovní náplně.\r\nMomentálně pracuji na Dohodu, v rámci jednoho vzdělávacího projektu a snažím se aktivně hledat ideální pracovní příležitost.\r\nV příloze zasílám svůj životopis k nahlédnutí.\r\n\r\nPředem děkuji za Vaší odpověď.\r\n\r\nS pozdravem a přáním krásného dne\r\nKlára Kolaříková','2019-02-14 10:51:14',NULL),
	(35,'BI Report Builder','Lucie Staňková','Lucie.Stankova@acamar.cz','BuySEOTools.Org','BuySEOTools.Org','hello@buyseotools.org','0688 684 54 76','','','Hello,\r\n\r\nHow are you dear?\r\n\r\nI am just contacting to you because you are in the field of digital marketing.\r\n\r\nYou may know or need Ahrefs tool?\r\n\r\nWe provide it at just $10/month: https://buyseotools.org\r\n\r\nIf you have any question just contact us;\r\n\r\nEmail: buyseotools.org@gmail.com\r\nSkype: live:buyseotools.org\r\n\r\nRegards,\r\nBuySEOTools Team\r\nhttps://www.buyseotools.org','2019-03-19 22:18:57',877),
	(36,'Senior MS Dynamics CRM Developer','Michala Klapalová','michala.klapalova@acamar.cz','Paige Field','Paige Field','paige.field@googlemail.com','09201 50 44 56','','','www.cmspojie.com - CMS破解站提供世界顶级设计师的无限网站模板，Wordpress主题，Opencart主题,Magento主题,Prestashop主题，Shopify主题，HTML网站模板，各种CMS模板资源尽在CMS破解站!\r\n高端网站设计\r\nwordpress模板\r\nmagento\r\nmagento模板\r\nshopify插件','2019-04-09 16:11:35',NULL),
	(37,'Recruiter for Russian-speaking markets','Lucie Staňková','Lucie.Stankova@acamar.cz','Fidan','Zohrabova','fidan.zohrabova@gmail.com','+994515222772','cv/81748c2969521f4191766a779b580f77/Fidan ZOHRABOVA\'s Resume.pdf','https://www.linkedin.com/in/fidan-zohrabova-95b454131/','Dear Ms. Staňková ,\r\n\r\nGood afternoon!\r\n\r\nI would like to introduce myself as a perfect candidate for Recruiter for Russian-speaking markets position in your company with professional attitude and fluent English, native Russian skills. With my education and work experience, I am confident in my ability and very motivated to be beneficial for you and be a great part of Acamar family.\r\n\r\nAt my previous role, I was part of the Operations Secretariat Team at the Baku Expo 2025 Azerbaijan (World Expo Candidate city) project. I effectively performed tasks such as organizing meetings of VIP customers’ with Task Force Members and Executive Director on behalf of Expo 2025, as well as paperwork, filing, managing all incoming calls and emails, drafting of documents and their archiving, scheduling events, organizing dinners and luncheons on governmental level, setting up catering and rooms for company events, update of events calendar and contacts of delegates worldwide, ordering supplies such as collateral, backdrops, VIP gifts for Expo delegates.\r\n\r\nI graduated from Università della Svizzera Italiana (Switzerland, Ticino, Lugano city) and holding a Master degree in Management. I also have a Bachelor degree in Business Administration. The nature of my degree course has prepared me for this position. I am a conscientious person who works hard and pays attention to detail. I am flexible, quick to pick up new skills and eager to learn from others. As well as I am able to take on the responsibility of this position immediately, and have the enthusiasm and determination to ensure that I make a\r\nsuccess of it.\r\n\r\nCurrently, I am working at Formula 1 and Azerbaijan Grand Prix (Baku City Circuit Operations Company) as a Corporate Sales Supervisor and will be done with my job at the end of April. I am in charge of working with VIP guests: providing tickets on Paddock Club, Crystal Hall Sky Boxes and VIP Corporate Boxes, VIP Lounge. Additionally, accommodation of celebrities and VIP guests in the Hotels, meeting their needs, solving problems upon receipts, as well as meeting and greeting on event dates.\r\n\r\nI also had an amazing opportunity to have 3 months Internship Program in the Marketing Department in Vicenza, Italy at luxury Jewelry Company called Roberto Coin S.p.A. I was working with personal project and was in charge of preparing Presentation (including financial report) of the new concept of the store for future clients.\r\n\r\nThank you for your time and consideration.\r\n\r\nI look forward to hearing from you.\r\n\r\nSincerely,\r\n\r\nFidan ZOHRABOVA.','2019-04-13 08:05:22',885),
