INSERT INTO `acamar_web_acafriendcard` (`cmsplugin_ptr_id`, `author`, `author_position`, `text`, `image_id`)
VALUES
	(137,'Vojtěch Kotous','Business Analyst','„S Acamarem spolupracuji, protože vím, že se na ně mohu spolehnout. Vše začalo výběrem prvního projektu, jehož náplň mě zaujala. Vždy platí v termínu a plní dohody i jen na základě podání ruky. Kdo vám takový individuální servis dnes poskytne? I proto s Acamarem spolupracuji již od roku 2013.“',120),
	(138,'Tomaš Grošup','Business Analyst / Senior .NET Developer','„S Acamarem spolupracuji 3,5 roku a nemohu si vynachválit bezproblémovou spolupráci a perfektní dodržování termínů. Navíc hlídají i mé povinnosti a já mám tak o starost méně.“',119),
	(139,'Andrei Sokolov','Java Developer','„Acamar has given me a great opportunity to move to the Czech Republic. They took care of all the paperwork and accompanied the whole process of relocation with the necessary documents and clear instructions. Many great specialists work with Acamar out-staffing different projects, we meet regularly in a friendly atmosphere. It is really nice to live and work here.“',121),
	(272,'Marek Novák','CRM Data Analyst v Air Bank','\"Kurzy byly super, předčily má očekávání. Byly dělané hravou formou, teorii jsme čerpali z praxe a zkušeností naší skvělé lektorky. Byl jsem v této oblasti naprostý začátečník. Díky kurzu jsem si našel práci, která mě baví a našel jsem v ní své druhé já.\"',118),
	(273,'Alžběta Žembová','Testerka v Adastře','\"Školenia ma naučili písať test case, čo je vlastne bug,  a taktiež aj pracovať so systémom Jira alebo SoapUI. Lektorka je veľmi milá a dokáže učivo kvalitne vysvetliť aj úplným začiatočníkom v oblasti IT. Nakoniec mi spoločnosť Acamar našla skvelú prácu na pozícii testera, kde som veľmi spokojná.\"',117),
	(1187,'Vojtěch Kotous','Business Analyst','\"We cooperate with Acamar because I know we can rely on them. It all began with selecting the first project that I was interested in. They always pay on time and fulfil agreements even if they are only based on a handshake. Who provides you with such service nowadays? This is also why we have been cooperating with Acamar since 2013.\"',120),
	(1188,'Tomaš Grošup','Business Analyst / Senior .NET Developer','\"I have been cooperating with Acamar for 3.5 years and I couldn\'t be happier with our cooperation. They meet deadlines perfectly. They also look after my obligations, so that is one less thing for me to worry about.\"',119),
	(1189,'Andrei Sokolov','Java Developer','\"Acamar has given me a great opportunity to move to the Czech Republic. They took care of all the paperwork and accompanied the whole process of relocation with the necessary documents and clear instructions. Many great specialists work with Acamar out-staffing different projects, we meet regularly in a friendly atmosphere. It is really nice to live and work here.\"',121),
	(1232,'Karek Novák','CRM Data Analyst v Air Bank','Kurzy byly super, předčily má očekávání. Byly dělané hravou formou, teorii jsme čerpali z praxe a zkušeností naší skvělé lektorky. Byl jsem v této oblasti naprostý začátečník. Díky kurzu jsem si našel práci, která mě baví a našel jsem v ní své druhé já.',118),
	(1233,'Alžběta Žembová','Testerka v Adastře','Školenia ma naučili písať test case, čo je vlastne bug,  a taktiež aj pracovať so systémom Jira alebo SoupUi. Lektorka je veľmi milá a dokáže učivo kvalitne vysvetliť aj úplným začiatočníkom v oblasti IT. Nakoniec mi spoločnosť Acamar našla skvelú prácu na pozícii testera, kde som veľmi spokojná.',117),
	(1282,'Войтех Котоус','Бизнес-аналитик','«С компанией «Acamar» я сотрудничаю, так как знаю, что на них можно положиться. Все началось при выборе первого проекта, содержание которого меня заинтересовало. Компания выполняет все договоренности, включая неформальные, счета оплачивает в срок. Кто вам в настоящее время предоставит такой сервис? И поэтому я сотрудничаю с компанией Acamar уже с 2013 года».',120),
	(1283,'Томаш Грошуп','Бизнес-аналитик / Старший .NET разработчик','«С компанией Аcamar я сотрудничаю уже 3,5 года и очень доволен безупречным сотрудничеством и соблюдением сроков. Компания, кроме прочего, следит и за выполнением моих обязанностей, освобождая меня от лишних забот».',119),
	(1284,'Андрей Соколов','Java Developer','\"Acamar has given me a great opportunity to move to the Czech Republic. They took care of all the paperwork and accompanied the whole process of relocation with the necessary documents and clear instructions. Many great specialists work with Acamar out-staffing different projects, we meet regularly in a friendly atmosphere. It is really nice to live and work here.\"',121),
	(1327,'Марек Новак','CRM Data Analyst - Air Bank','«Курсы были супер, превзошли все мои ожидания. Были сделаны игровой формой, теорию мы получали из практики и опыта нашего великолепного лектора. Я был в этой сфере абсолютный новичок. Благодаря курсу я нашел работу, которая мне нравится, и я нашел в ней свое второе я.»',118),
	(1328,'Алжбета Жембова','Tестировщик - Adastra','«Тренинг научил меня писать тестовый кейс, который на самом деле является багом, а также работать с системой Jira, или SoapUI. Лектор очень добр и способен хорошо объяснить учебу даже полноценному новичку в сфере IT. Наконец, мне компания Acamar нашла отличную работу на посту тестировщика, где я очень довольная.»',117),
	(4130,'Karek Novák','CRM Data Analyst v Air Bank','Kurzy byly super, předčily má očekávání. Byly dělané hravou formou, teorii jsme čerpali z praxe a zkušeností naší skvělé lektorky. Byl jsem v této oblasti naprostý začátečník. Díky kurzu jsem si našel práci, která mě baví a našel jsem v ní své druhé já.',118),
