	(263,'Svým kontraktorům jsme vyjednali slevy','na kávu i služby profesionálů','<p><big>K získání slevy vám stačí nahlásit u vybraného poskytovatele služby své jméno a číslo Acarty. Jen při nákupu kávy je potřeba předložit kartu fyzicky.</big></p>\n'),
