	(862,'Právní služby','Přemek opravdu ví. Umí vyřešit cokoliv. Osobně jsme to vyzkoušeli.','<p class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"><span style=\"\"><span style=\"\"><span style=\"\"><span style=\"text-decoration: none;\"><b>Kdo to je:</b></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\n\n<ul>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Přemek Líbal pomáhal s uzavíráním smluv s dodavateli a zákazníky na všech kontinentech. S výjimkou Antarktidy. Zatím!</span></span></li>\n</ul>\n\n<p class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"><span style=\"\"><span style=\"\"><span style=\"\"><span style=\"text-decoration: none;\"><b>Co nabízí a za kolik: </b></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\n\n<ul>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Ve spolupráci s partnerskými advokáty a advokátními kancelářemi zajistí komplexní právní podporu ve všech oblastech života.</span></span></li>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Obchodní, osobní, trestní, nemovitosti, rodina spolupracuje.