	(1243,' Účetnictví','Petra Řeháčková perfektně rozumí účetnictví a má trpělivost na komunikaci s úřady.','<p><b>Kdo to je:</b></p>\n\n<ul>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Účetní a účetní poradce, který ví o daních vše a rád se o tebe postará i v zastupování s úřady.</span></span></li>\n</ul>\n\n<p><b>Co nabízí a za kolik:</b></p>\n\n<ul>\n	<li style=\"margin: 0cm;\">Kompletní vedení a správu účetnictví, zastupování před úřady -  jak pro fyzické, tak i pro právnické osoby. To vše s 30% slevou.</li>\n</ul>\n\n<p style=\"\"><span style=\"font-size: 11pt;\"><span style=\"line-height: normal;\"><span style=\"font-family: Calibri, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"><span style=\"\"><span style=\"\"><span style=\"\"><span style=\"text-decoration: none;\"><span style=\"background-color: white;\"><span style=\"\"><span style=\"\"><b><span lang=\"EN-US\" style=\"font-size: 10.5pt;\"><span style=\"font-family: Helvetica;\"><span style=\"color: #333333;\">Email:</span></span></span></b><span lang=\"EN-US\" style=\"font-size: 10.5pt;\"><span style=\"font-family: Helvetica;\"><span style=\"color: #333333;\"> rehackova.petra@seznam.cz</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\n\n<p style=\"\"><span style=\"font-size: 11pt;\"><span style=\"line-height: normal;\"><span style=\"font-family: Calibri, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"