	(1246,'Kávový klub','Pro dobrou kávu zamiřte sem. Chlapci a dívky z kávového klubu o ní vědí vše!','<p class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"><span style=\"\"><span style=\"\"><span style=\"\"><span style=\"text-decoration: none;\"><b>Kdo to je:</b></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\n\n<ul>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Baristi, kteří opravdu rozuměji svému řemeslu a umí pěkně kreslit do mléčné pěny.</span></span></li>\n</ul>\n\n<p class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"><span style=\"\"><span style=\"\"><span style=\"\"><span style=\"text-decoration: none;\"><b>Co nabízí a za kolik:</b></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\n\n<ul>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Slevu 10 % na kompletní sortiment kávových nápojů a zrnkové kávy na svých pobočkách včetně trhů. Info o lokalitách na jejich webu.</span></span></li>\n</ul>\n\n<p style=\"\"><span style=\"font-size: 11pt;\"><span style=\"line-height: normal;\"><span style=\"font-family: Calibri, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span st