	(1248,'Kweku','Nejlepší stavební firma na trhu. Rozumějí stavbám a drží slovo.','<p class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"><span style=\"\"><span style=\"\"><span style=\"\"><span style=\"text-decoration: none;\"><b>Kdo to je:</b></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\n\n<ul>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Komplexní dodavatel staveb na klíč, rekonstrukcí a poradenství.</span></span></li>\n</ul>\n\n<p class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"><span style=\"\"><span style=\"\"><span style=\"\"><span style=\"text-decoration: none;\"><b>Co nabízí a za kolik: </b></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\n\n<ul>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Kompletní dodávky stavebních a interiérových prací včetně ingeneeringu staveb.</span></span></li>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Rekonstrukce bytů nebo domů včetně veškerého papírování.</span></span></li>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-f