	(1340,'Letuška.cz','Až budete řešit dovolenou, tady najdete letenky a ubytování za skvělé ceny.','<p class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"><span style=\"\"><span style=\"\"><span style=\"\"><span style=\"text-decoration: none;\"><b>Kdo to je:</b></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\n\n<ul>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Na Letušce si můžete rezervovat letenky a objednávat veškeré možné služby spojené s cestováním po celém světě.</span></span></li>\n</ul>\n\n<p class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"><span style=\"\"><span style=\"\"><span style=\"\"><span style=\"text-decoration: none;\"><b>Co nabízí a za kolik:</b></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\n\n<ul>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Jako benefit jsme pro vás sjednali slevu <b>490,- Kč</b>, kterou získáte formou promo kódu.</span></span></li>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Promo kód je: <b>ACAMAR_016540</b>, je jednotný pro všechny, platný do 31.12.2018 a počet jeh