	(106,'Finanční pohoda ​​​​​​​na IČO i HPP','Faktury platíme s přesností švýcarských hodinek. Navíc dostanete Acartu se spoustou benefitů a slev.\r\n','0 %','faktur po splatnosti'),
	(107,'Rotace ​​​​​​​na projektech','Končíte na projektu? Systém nám to ohlásí. Sami se ozveme se zajímavými nabídkami. I na kontraktu tak máte stále jistotu práce.\r\n','22','měsíců je průměrná doba projektu'),
