	(4953,'Беспроблемное получение гонорара в качестве частного предпринимателя или сотрудника, работающего по трудовому договору с фирмой','Зарплату мы переводим точно в срок.\r\nК тому же Вы получите А-карту с множеством выгодных предложений и скидок.','0 %','просроченные счета'),
