	(6,'Berniceamurb','bernicedob@pro-expert.online','Novou pracovni vyzvu','Привет. Предлагаем Вам наши услуги в области международных перевозок грузов. \r\nОказываем услуги международных перевозок грузов по основным маршрутам: Россия (Челябинск, Екатеринбург, Пермь, Новосибирск, Красноярск, Омск, Тюмень, Томск) - Беларусь - Казахстан. \r\nНо можем организовать грузоперевозку по любым Вами предложенным направлениям. \r\nБолее расширенно предлагаем узнать на сайте компании \"МиТур\" - https://mityr-trans.com \r\nНевероятно рады видеть Вас в числе наших клиентов.','cs','2018-10-26 17:59:30'),
	(7,'FrankcoX','larisanagonova775@mail.ru','Novou pracovni vyzvu','[url=https://www.baikaleminer.com/#portfolio]майнер байкал официальный[/url] - асик майнер байкал, байкал 10 майнер','cs','2018-10-27 10:02:43'),
