	(270,' Kurzem vás provede Lucie','Lucie Tvrdíková','Lektorka kurzů','<p>Java programátorkou se <strong>Lucie Tvrdíková</strong> stala v roce 2009. Od té doby čerpá zkušenosti na různých projektech, vede menší tým lidí a učí juniory. V práci se dostane i k analýze, a když není k dispozici tester, zaskočí za něj.</p>\n\n<p>Zdá se vám, že dostat se do IT je složité? Lucka vám ukáže, že na začátku nepotřebujete nic jiného, než chuť se učit. Na kurzech je trpělivá lektorka, zato v práci známý puntičkář. Dokud je Lucie na projektu, best practices musí dodržovat nejen její tým, ale dokonce i zákazník a management.</p>\n\n<p>Když nepracuje, baví ji houbaření, rybaření a festivaly. A když se jí zrovna chce, ve vaření prý strčí do kapsy Pohlreicha.</p>\n',136),
	(1230,' Kurzem vás provede Lucie','Lucie Tvrdíková','Lektorka kurzů','<p>Java programátorkou se <strong>Lucie Tvrdíková</strong> stala v roce 2009. Od té doby čerpá zkušenosti na různých projektech, vede menší tým lidí a učí juniory. V práci se dostane i k analýze, a když není k dispozici tester, zaskočí za něj.</p>\n\n<p>Zdá se vám, že dostat se do IT je složité? Lucka vám ukáže, že na začátku nepotřebujete nic jiného, než chuť se učit. Na kurzech je trpělivá lektorka, zato v práci známý puntičkář. Dokud je Lucie na projektu, best practices musí dodržovat nejen její tým, ale dokonce i zákazník a management.</p>\n\n<p>Když nepracuje, baví ji houbaření, rybaření a festivaly. A když se jí zrovna chce, ve vaření prý strčí do kapsy Pohlreicha.</p>\n',136),
	(1325,'Курс ведет Люция Тврдикова','Люция Тврдикова','лектор курсов','<p><strong>Люция Тврдикова</strong> стала Java программистом в 2009 году. С тех пор получает опыт на различных проектах, руководит небольшой группой людей и обучает специалистов юниоров. Она также работает над анализами, и когда не хватает тестера, она способна его заменит.</p>\n\n<p>Вам кажется, что попасть в IT - это сложно? Люция Вам покажет, что в начале Вам ничего не нужно, только желание учиться. На курсах она терплива, за то на работе она известный педант. Пока Люция работает над проектом, лучшие виды практики, все, т.е. ее команда, заказчик и руководство должны соблюдать.</p>\n\n<p>Когда не работает, она любит ходить за грибами, увлекается рыбалкой и музыкальными фестивалями. Когда у нее настроение, и все получается, то она готовит лучше, чем Polreich.</p>\n',136),
	(4128,' Kurzem vás provede Lucie','Lucie Tvrdíková','Lektorka kurzů','<p>Java programátorkou se <strong>Lucie Tvrdíková</strong> stala v roce 2009. Od té doby čerpá zkušenosti na různých projektech, vede menší tým lidí a učí juniory. V práci se dostane i k analýze, a když není k dispozici tester, zaskočí za něj.</p>\n\n<p>Zdá se vám, že dostat se do IT je složité? Lucka vám ukáže, že na začátku nepotřebujete nic jiného, než chuť se učit. Na kurzech je trpělivá lektorka, zato v práci známý puntičkář. Dokud je Lucie na projektu, best practices musí dodržovat nejen její tým, ale dokonce i zákazník a management.</p>\n\n<p>Když nepracuje, baví ji houbaření, rybaření a festivaly. A když se jí zrovna chce, ve vaření prý strčí do kapsy Pohlreicha.</p>\n',136),
	(4645,'Курс ведет Люция Тврдикова','Люция Тврдикова','лектор курсов','<p><strong>Люция Тврдикова</strong> стала Java программистом в 2009 году. С тех пор получает опыт на различных проектах, руководит небольшой группой людей и обучает специалистов юниоров. Она также работает над анализами, и когда не хватает тестера, она способна его заменит.</p>\n\n<p>Вам кажется, что попасть в IT - это сложно? Люция Вам покажет, что в начале Вам ничего не нужно, только желание учиться. На курсах она терплива, за то на работе она известный педант. Пока Люция работает над проектом, лучшие виды практики, все, т.е. ее команда, заказчик и руководство должны соблюдать.</p>\n\n<p>Когда не работает, она любит ходить за грибами, увлекается рыбалкой и музыкальными фестивалями. Когда у нее настроение, и все получается, то она готовит лучше, чем Polreich.</p>\n',136),
	(4907,' Kurzem vás provede Lucie','Lucie Tvrdíková','Lektorka kurzů','<p>Java programátorkou se <strong>Lucie Tvrdíková</strong> stala v roce 2009. Od té doby čerpá zkušenosti na různých projektech, vede menší tým lidí a učí juniory. V práci se dostane i k analýze, a když není k dispozici tester, zaskočí za něj.</p>\n\n<p>Zdá se vám, že dostat se do IT je složité? Lucka vám ukáže, že na začátku nepotřebujete nic jiného, než chuť se učit. Na kurzech je trpělivá lektorka, zato v práci známý puntičkář. Dokud je Lucie na projektu, best practices musí dodržovat nejen její tým, ale dokonce i zákazník a management.</p>\n\n<p>Když nepracuje, baví ji houbaření, rybaření a festivaly. A když se jí zrovna chce, ve vaření prý strčí do kapsy Pohlreicha.</p>\n',136);
