INSERT INTO `acamar_web_partnersitem` (`cmsplugin_ptr_id`, `title`, `text`, `image_id`)
VALUES
	(498,'Commerz Systems','<div class=\"text-weight-light\" style=\"\">\n<p>„Profesionální přístup, rychlá reakce na častou změnu požadovaných profilů, prověření kandidáti, velice příjemná spolupráce. To je Acamar!“<br>\n<br>\nIgor Savič, Group Leader v Commerz Systems</p>\n</div>\n',178),
	(627,'Reporting.cz','<div class=\"text-weight-light\" style=\"\">\n<p>„Pro náš projekt jsme potřebovali lidi, kteří mají kompetence v oblasti analýzy i vývoje. Acamar nám dodal špičkové odborníky, kteří naprosto splňovali naše požadavky.“<br>\n<br>\nMichal Rozehnal, CEO ve firmě Reporting.cz</p>\n</div>\n',181),
	(628,'Deloitte','<div class=\"text-weight-light\" style=\"\">\n<p>„Spolupráce s Acamarem vždy probíhala na velmi profesionální úrovni. Na čem jsme se domluvili, to platilo. Vždy jsem se na ně mohl spolehnout.“<br>\n<br>\nMartin Hudos, Senior Manager v Deloitte</p>\n</div>\n',70),
	(629,'Proboston','<div class=\"text-weight-light\" style=\"\">\n<p>„S Acamarem jsme si sedli už od začátku. Řekli jsme si, koho přesně potřebujeme. Obrovskou výhodou je, že nesleduje jenom zkušenosti potenciálního kandidáta, ale i jeho přístup a chování. A v neposlední řadě si představuje, zda daný člověk dokáže v našem dost složitém firemním ekosystémů fungovat.“<br>\n<br>\nFilip Líbal, jednatel Probostonu</p>\n</div>\n',180),
	(1212,'Commerz Systems','<div class=\"text-weight-light\" style=\"\">\n<p>\"Professional approach, quick response to the frequent change in the required profiles, background checks of candidates, very pleasant cooperation. That\'s Acamar!\"</p>\n\n<p>Igor Savič, Group Leader at Commerz Systems</p>\n</div>\n',178),
	(1213,'Reporting.cz','<div class=\"text-weight-light\" style=\"\">\n<p>\"For our project, we needed people, who are competent in the area of analysis and development. Acamar provided us with the best professionals, who absolutely met our requirements.“<br>\n<br>\nMichal Rozehnal, CEO at Reporting.cz</p>\n</div>\n',181),
	(1214,'Deloitte','<div class=\"text-weight-light\" style=\"\">\n<p>\"Cooperation with Acamar is always on a very professional level. Whatever we agree on is a done deal. I can always rely on them.“<br>\n<br>\nMartin Hudos, Senior Manager at Deloitte</p>\n</div>\n',70),
	(1215,'Proboston','<div class=\"text-weight-light\" style=\"\">\n<p>\"With Acamar, it all just clicked from the very beginning. We talked about what people we needed. The Acamar team aren’t interested only in experience but also in approach and behaviour of potential candidate, which is a huge advantage. Last but not least, they try to imagine how a given person could work in our quite comprehensive company ecosystem.“<br>\n<br>\nFilip Líbal, owner of Proboston</p>\n</div>\n',180),
	(1307,'Коммерческие системы','<div class=\"text-weight-light\" style=\"\">\n<p>«Профессиональный подход, быстрая реакция на частое изменение требуемых профилей, проверенные кандидаты, очень приятное сотрудничество. Это и есть компания Acamar!»</p>\n\n<p>Игорь Савич, руководитель группы Коммерческие системы</p>\n</div>\n',178),
	(1308,'Reporting.cz','<div class=\"text-weight-light\" style=\"\">\n<p>«Для нашего проекта нам нужны были люди, которые компетентны в области анализа и развития. Компания „Acamar“ нам прислала высококвалифицированных специалистов, полностью отвечающих нашим требованиям».<br>\n<br>\nМихал Розегнал, CEO в компании «Reporting.cz»</p>\n</div>\n',181),
	(1309,'Deloitte','<div class=\"text-weight-light\" style=\"\">\n<p>«Сотрудничество с компанией Acamar всегда проходило на высокопрофессиональном уровне. О чем договорились, то было выполнено. На них я мог положиться.»</p>\n\n<p>Мартин Гудос, Старший менеджер компании «Deloitte»</p>\n</div>\n',70),
	(1310,'Proboston','<div class=\"text-weight-light\" style=\"\">\n<p>«С фирмой «Акамар» мы нашли общий язык с самого начала. Мы просто сообщили, кто именно нам нужен. Огромное преимущество состоит в том, что для фирмы «Акамар» важен не только опыт работы и профессиональные навыки будущего кандидата, но и его отношение к работе, а также поведение. Немаловажную роль играет и то, что фирма «Акамар» обращает внимание на то, сможет ли человек ужиться в нашей достаточно сложной экосистеме фирмы».</p>\n\n<p>Филип Либал, владелец фирмы «Пробостон»</p>\n</div>\n',180),
	(4758,'Commerz Systems','<div class=\"text-weight-light\" style=\"\">\n<p>„Profesionální přístup, rychlá reakce na častou změnu požadovaných profilů, prověření kandidáti, velice příjemná spolupráce. To je Acamar!“<br>\n<br>\nIgor Savič, Group Leader v Commerz Systems</p>\n</div>\n',178),
