INSERT INTO `acamar_web_teammember` (`id`, `name`, `nickname`, `text`, `order`, `image_id`, `nickname_cs`, `nickname_en`, `nickname_ru`, `text_cs`, `text_en`, `text_ru`, `linkedin`, `name_cs`, `name_en`, `name_ru`)
VALUES
	(1,'Illya Pavlov','šéf přezdívaný „Šeřík“','Určuji ve firmě směr a cíl. Starám se o to, aby měli Acamarádi ty nejlepší podmínky k práci. Vnitřní klid a sílu dočerpávám v helmě nebo s kuchyňským nožem v rukou.',1,150,'šéf přezdívaný „Šeřík“','Executive director','Илья Павлов, Заведующий, псевдоним «Сирень»','Určuji ve firmě směr a cíl. Starám se o to, aby měli Acamarádi ty nejlepší podmínky k práci. Vnitřní klid a sílu dočerpávám v helmě nebo s kuchyňským nožem v rukou.','I define the company\'s direction and goal. I make sure my people have the best working conditions. I get my inner peace by wearing a helmet or with a kitchen knife in my hands. ','Я определяю направление и цель компании. Забочусь о том, чтобы у сотрудников компании  Acamar были самые лучшие условия труда. Внутреннее спокойствие и силу я подзаряжаю в мотоциклетном шлеме или с кухонным ножом в руке.','https://www.linkedin.com/in/illyapavlov/','Illya Pavlov','Illya Pavlov',NULL),
	(2,'Michala Klapalová','teamleaderka „Malina“','Už skoro 4 roky hledám nové duše pro naše zákazníky, což dnes dělám už se svým týmem. Kdybych nepracovala v Acamaru, nejspíš bych sbírala medaile za badminton, volejbal, běh i jízdu na kole.\r\n',3,152,'teamleaderka „Malina“','Team Leader','Михала Клапалова, Лидер команды, псевдоним «Малина»','Už skoro 4 roky hledám nové duše pro naše zákazníky, což dnes dělám už se svým týmem. Kdybych nepracovala v Acamaru, nejspíš bych sbírala medaile za badminton, volejbal, běh i jízdu na kole.\r\n','I have been looking for new souls for our customers for almost 4 years now, which I am now doing with my team. \r\nIf I weren\'t working for Acamar, I would probably be collecting medals for badminton, volleyball, running and cycling.\r\n','Я уже почти 4 года ищу новые „души“ для наших заказчиков, в настоящее время у меня для того есть уже своя команда. \r\nЕсли бы я не работала в компании Acamar, то я бы наверняка получала медали по бадминтону, волейболу, бегу и езде на велосипеде.','https://www.linkedin.com/in/michalavalova/','Michala Klapalová','Michala Klapalová',NULL),
	(3,'Blanka Rubišová','vůdkyně recruiterů alias „Karel“','Začínala jsem jako IT recruiterka a dnes se starám o náš rostoucí tým skvělých kolegů. I po 5 letech v Acamaru mě baví zlepšovat interní procesy a nestát na místě.\r\nKdyž se mi něco nelíbí, řeknu to dost hlasitě. Spíš než nákup oblečení mi udělá radost pivo a dobrá večeře.\r\n',2,151,'vůdkyně recruiterů alias „Karel“','Recruitment Leader','Бланка Рубишова, Главный агент по найму, псевдоним «Карел»','Začínala jsem jako IT recruiterka a dnes se starám o náš rostoucí tým skvělých kolegů. I po 5 letech v Acamaru mě baví zlepšovat interní procesy a nestát na místě.\r\nKdyž se mi něco nelíbí, řeknu to dost hlasitě. Spíš než nákup oblečení mi udělá radost pivo a dobrá večeře.\r\n',' I started off as an IT recruiter and today, I look after our growing team of excellent colleagues. Even after working for Acamar for 5 years, I enjoy improving internal processes and keep the company moving forward. If there is anything I don\'t like, I speak out loudly. I prefer beer and a good dinner to buying clothes. ','Я начинала как IT-рекрутер и в настоящее время забочусь о нашей увеличивающейся команде отличных коллег. И спустя пять лет работы в компании Acamar мне нравится улучшать внутренние процессы и двигаться вперед.\r\nКогда мне что-то не нравится, я об этом открыто заявлю. \r\nХороший ужин с пивом порадует меня больше  покупки новой одежды.\r\n','https://www.linkedin.com/in/blankarubisova/','Blanka Rubišová','Blanka Rubišová',NULL),
	(5,'Anna Vacíková','Account Manager „Vacka“','Podle 1. písmena v příjmení: Vstřícná, veselá, vyrovnaná, vytrvalá – s výsledky vždy včas. Kromě vedení týmu pomáhám největšímu zákazníkovi s plánováním a dodávkou vývojových kapacit. Radost mi dělá sport, přátelé a kultura.\r\n',5,210,'Account Manager „Vacka“','Account Manager','Анна Вацикова, Account Manager, псевдоним «Вацка»','Podle 1. písmena v příjmení: Vstřícná, veselá, vyrovnaná, vytrvalá – s výsledky vždy včas. Kromě vedení týmu pomáhám největšímu zákazníkovi s plánováním a dodávkou vývojových kapacit. Radost mi dělá sport, přátelé a kultura.\r\n','I am helpful, happy, balanced, persistent – with results always on time. Apart from leading a team, I help the biggest customer plan and supply development capacities.  \r\nI enjoy sports, friends and culture.\r\n','По первой букве в фамилии: веселая, встречная, выровненная и работа сделана всегда вовремя. \r\nЯ руковожу командой, помогаю самому крупному заказчику планировать поставку и потенциал мощностей. \r\nРадость мне доставляет спорт, друзья и культура.\r\n','https://www.linkedin.com/in/anna-vac%C3%ADkov%C3%A1-57329984/','Anna Vacíková','Anna Vacíková',NULL),
	(6,'Gabriela Skálová','Account Manager „Mojmír“','Mimo jiné jsem stála u zrodu našeho komplexního CRM, které je součástí našeho know-how. Ráda podnikám výlety s 2letou dcerkou, běhám nebo vyrazím do hor.\r\n',6,154,'Account Manager „Mojmír“','Account Manager','Габриела Скалова, Account Manager, псевдоним «Моймир»','Mimo jiné jsem stála u zrodu našeho komplexního CRM, které je součástí našeho know-how. Ráda podnikám výlety s 2letou dcerkou, běhám nebo vyrazím do hor.\r\n','Among other things, I was at the beginning of our complex CRM, which is currently our know-how. \r\nI like taking trips with my 2-year old daughter, running or hiking into the mountains. ',' Кроме прочего, я присутствовала при возникновении нашего комплексного CRM,  который является составной частью нашего ноу-хау. \r\nЛюблю ходить на прогулки с двухлетней дочкой, бегаю или отправляюсь в горы.','https://www.linkedin.com/in/gabriela-sk%C3%A1lov%C3%A1-561b4532/','Gabriela Skálová','Gabriela Skálová',NULL),
	(7,'Tereza Jarolímková','seniorní recruiterka „TýDžej“','Pro spokojenost klienta se umím rozkrájet. Proto drtivá většina mnou dodaných specialistů pochází z velkých dálek. V práci mě baví skvělý kolektiv. Mimo kancelář mě povětšinou uvidíte s přáteli u piva a pořádného hovězího steaku.\r\n',7,207,'seniorní recruiterka „TýDžej“','Senior Recruiter','Тереза Яролимкова, Старший рекрутер, псевдоним «ТиДжей»','Pro spokojenost klienta se umím rozkrájet. Proto drtivá většina mnou dodaných specialistů pochází z velkých dálek. V práci mě baví skvělý kolektiv. Mimo kancelář mě povětšinou uvidíte s přáteli u piva a pořádného hovězího steaku.\r\n','I do my best to keep the customer happy. Therefore, the vast majority of the specialists I provide come from afar. I like working with the great team.  \r\nOutside of the office, I am usually drinking beer and eating a hearty beef steak with friends. \r\n','Для удовлетворения клиентов могу расшибиться в лепешку. Поэтому большинство  рекомендованных мной специалистов приезжает издалека. На работе меня радует  прекрасный коллектив. \r\nВне офиса меня часто можно встретить с друзьями с кружкой пива и хорошим куском бифштекса.','https://www.linkedin.com/in/tereza-jarol%C3%ADmkov%C3%A1-3bb30a43/','Tereza Jarolímková','Tereza Jarolímková',NULL),
	(8,'Lucie Staňková','recruiterka „Batista“','Najdu lidi na projekt i tam, kde je ostatní nenajdou. Zároveň udržuji při životě testovací prostředí, naše kurzy a spoustu dalších věcí. Kromě toho zbožňuji hudbu: zpěv, kytaru, klávesy, klarinet, bicí i irské tance.\r\n',8,156,'recruiterka „Batista“','Recruiter','Луцие Станькова, Агент по найму, псевдоним «Батиста»','Najdu lidi na projekt i tam, kde je ostatní nenajdou. Zároveň udržuji při životě testovací prostředí, naše kurzy a spoustu dalších věcí. Kromě toho zbožňuji hudbu: zpěv, kytaru, klávesy, klarinet, bicí i irské tance.\r\n','I find people for the project, where others don\'t even look. I also keep the testing environment, our courses and many other things alive.  \r\nI also love music, singing, the guitar, the clarinet, the drums and Irish dancing.\r\n','Я найду людей для проекта и там, где их другие не найдут. Одновременно поддерживаю наше тестирование, курсы и много других вещей. \r\nКроме того я обожаю музыку: пение, гитару, клавишные инструменты, кларнет, ударные и ирландские танцы.','https://www.linkedin.com/in/lucie-sta%C5%88kov%C3%A1-7a3437b4/','Lucie Staňková','Lucie Staňková',NULL),
	(10,'Tereza Simotová','office koordinátorka „Simona“','V Acamaru se starám o to, aby všichni měli to, co potřebují a všechno bylo v kanceláři v pořádku. Zároveň držím pod palcem smlouvy, objednávky i faktury. Volno trávím s rodinou a dobrým pitím v ruce.\r\n',10,159,'office koordinátorka „Simona“','Office Coordinator','Тереза Симотова, Офис-координатор псевдоним «Симона»','V Acamaru se starám o to, aby všichni měli to, co potřebují a všechno bylo v kanceláři v pořádku. Zároveň držím pod palcem smlouvy, objednávky i faktury. Volno trávím s rodinou a dobrým pitím v ruce.\r\n','In Acamar, I make sure that everyone has what they need  and everything in the office is in order. I am also responsible for agreements, orders and invoices. I spend my free time with my family and a good drink in my hands. ','В компании „Acamar“ я забочусь о том, чтобы у всех было все необходимое и чтобы в офисе было все в порядке. Одновременно слежу за всеми договорами, заказами и счетами. \r\nСвободное время провожу с семьей за бокалом приятного напитка.','https://www.linkedin.com/in/tereza-simotov%C3%A1-450132167/','Tereza Simotová','Tereza Simotová',NULL),
	(11,'Šárka Bláhovcová','organizátor „Bláhovec“','Podpora a rozvoj brandu, spolupráce s vysokými školami, veletrhy, konference či meetupy – to všechno je moje práce. Nikdo si na mě nepřijde, neunikne mi žádný detail. Ve firmě mi říkají ekoaktivista. Když zrovna nepracuji, tak cestuji nebo se věnuji sportu.',11,16,'organizátor „Bláhovec“','Organizer','Шарка Благовцова Организатор псевдоним «Благовец»','Podpora a rozvoj brandu, spolupráce s vysokými školami, veletrhy, konference či meetupy – to všechno je moje práce. Nikdo si na mě nepřijde, neunikne mi žádný detail. Ve firmě mi říkají ekoaktivista. Když zrovna nepracuji, tak cestuji nebo se věnuji sportu.','Support and brand development, cooperation with universities, exhibitions, conferences and meet-ups – this is my job. No one catches me off guard, I don\'t miss any detail. They call me the eco-activist. When I am not working, I travel or play sports. ','Моей задачей является поддержка и развитие бренда, сотрудничество с высшими учебными заведениями, ярмарками, конференциями или встречами. У меня никто и ничто не останется незамеченным. В компании меня зовут эко-активистом. Когда не работаю, так путешествую или занимаюсь спортом. ','https://www.linkedin.com/in/sarkablahovcova/','Šárka Bláhovcová','Šárka Bláhovcová',NULL),
	(12,'Nikola Navrátilová','administrativní podpora „eNeN“','Na starosti mám fakturace, objednávky, administrativu i smlouvy. Zkrátka vše pro spokojenost našich lidí i zákazníků. Mám spoustu zájmů, drží mě ale dobrá káva, knihy, víno a výšlapy do přírody.\r\n',12,160,'administrativní podpora „eNeN“','Administrative Support','Никола Навратилова Административная поддержка, псевдоним «эНэН»','Na starosti mám fakturace, objednávky, administrativu i smlouvy. Zkrátka vše pro spokojenost našich lidí i zákazníků. Mám spoustu zájmů, drží mě ale dobrá káva, knihy, víno a výšlapy do přírody.\r\n','I am responsible for invoicing, orders, administration and agreements. In a nutshell, I make sure that our people and customers are happy. \r\nI have many hobbies. I like a good cup of coffee, books, wine and hiking into the nature. \r\n','Моей задачей являются административно-хозяйственные дела — заказы, договоры, оформление счетов. Короче говоря, все необходимое для удовлетворения заказчиков и наших сотрудников. \r\nЯ интересуюсь многим, но в первую очередь люблю хороший кофе, книги, вино и прогулки на природе. \r\n','https://www.linkedin.com/in/nikola-navr%C3%A1tilov%C3%A1-21481b97/','Nikola Navrátilová','Nikola Navrátilová',NULL),
	(15,'Markéta Koudelová','back office koordinátorka','Pečlivě, s úsměvem a včas zpracovávám a zefektivňuji administrativu pro naše největší zákazníky. Nejlépe si odpočinu u dobré knížky, čtení ale střídám se sportovními aktivitami.\r\n',15,206,'back office koordinátorka','Back Office Coordinator','Маркета Коуделова, Координатор вспомогательного отдела (Бэк-офис)','Pečlivě, s úsměvem a včas zpracovávám a zefektivňuji administrativu pro naše největší zákazníky. Nejlépe si odpočinu u dobré knížky, čtení ale střídám se sportovními aktivitami.\r\n','I thoroughly process and streamline administration for our biggest customers, all with a smile and in due time. \r\nI relax by reading a good book but I alternate reading with sports activities. \r\n','Старательно, с улыбкой и в срок обрабатываю административные материалы наших крупнейших заказчиков.\r\nЛучше всего я отдохну с хорошей книгой, но чтение я чередую со спортивными занятиями.','https://www.linkedin.com/in/mark%C3%A9ta-koudelov%C3%A1-398101126/','Markéta Koudelová','Markéta Koudelová',NULL),
	(17,'Jitka Kličková','alias „Nitka“','Vymýšlím jak zjednodušit a zprůhlednit administrativu tak, abychom se v blízké budoucnosti mohli zbavit co nejvíce papírů a podobných zbytečností. Ve volném čase se zajímám o vše kolem vína.\r\n',17,208,'alias „Nitka“','Administrative Support','Йитка Кличкова, Псевдоним «Нитка»','Vymýšlím jak zjednodušit a zprůhlednit administrativu tak, abychom se v blízké budoucnosti mohli zbavit co nejvíce papírů a podobných zbytečností. Ve volném čase se zajímám o vše kolem vína.\r\n','I think of ways to simplify and make administration more transparent so that we could get rid of as much paper and similar useless things in the near future as possible. \r\nIn my free time, I am interested in everything that has something to do with wine.','Я придумываю, как упростить и сделать более транспарантной административную деятельность, чтобы в будущем избавиться от множества бумаг и других бесполезных вещей. В свободное время я интересуюсь всем, что касается вина.','https://www.linkedin.com/in/jitka-kli%C4%8Dkov%C3%A1-a8b96b96/','Jitka Kličková','Jitka Kličková',NULL),
	(18,'František Mareth','Business Development Manager','Po předchozích zkušenostech z technologického consultingu a vývoje software jsem se rozhodl podpořit Acamar v jejich nové strategii. Hledám pro Acamar nové klienty, kteří chtějí pro sebe získat konkurenční výhodu při rozvoji jejich R&D nebo Shared Service Center. Pro nabrání nových sil si jdu zacvičit nebo zahrát tenis.',18,211,'Business Development Manager','Business Development Manager','Франтишек Марет, Business Development Manager','Po předchozích zkušenostech z technologického consultingu a vývoje software jsem se rozhodl podpořit Acamar v jejich nové strategii. Hledám pro Acamar nové klienty, kteří chtějí pro sebe získat konkurenční výhodu při rozvoji jejich R&D nebo Shared Service Center. Pro nabrání nových sil si jdu zacvičit nebo zahrát tenis.','After my previous experiences from technology consulting and software development area, I\'ve decided to support Acamar in their new strategy. I seek new clients who wish to gain a competitive advantage while developing their R&D or a Shared Service Center. After recruiting I usually work out or play tennis.','Исxодя из опытов технологического консталтинга и разработки программного обеспечения, я принял решение поддержать Acamar в ее новой стратегии. Я ищу для компании Acamar новых клиентов, которые хотят для себя приобрести конкурентное преимущество в развитии их R&D или Shared Service Center. Чтобы набрать новые силы иду в фитнесс или заняться теннисом.','https://www.linkedin.com/in/marethf/','František Mareth','František Mareth','František Mareth'),
	(19,'Tereza Birková','Back Office Koordinátorka','Spravuji fakturaci našich dvou nejobjemnějších vertikál a starám se o administrativu s tím spojenou. Mou snahou je udržet úsměv na rtech našich lidí i našich zákazníků. Na starosti mám také rozvoj a aktualizaci procesů.\r\nVolný čas trávím se svým psem, či na tréninku krav maga.\r\n',19,212,'Back Office Koordinátorka','Back Office Coordinator','Tереза Биркова, Координатор вспомогательного отдела (Бэк-офис)','Spravuji fakturaci našich dvou nejobjemnějších vertikál a starám se o administrativu s tím spojenou. Mou snahou je udržet úsměv na rtech našich lidí i našich zákazníků. Na starosti mám také rozvoj a aktualizaci procesů.\r\nVolný čas trávím se svým psem, či na tréninku krav maga.\r\n','I administer the invoicing of our two largest verticals and all the paperwork that comes with it. My job is to keep our employees and clients smiling. Process development and actualization are also my responsibilities. After work I train dogs, listen to music, hike in the nature or practice krav maga.','Суть моей работы заключается в обработке счет-фактур для наших двух главных вертикалей и одновременно я ответственна и за администрацию с тем связанную. Стараюсь, чтобы наши сотрудники и наши клиенты постоянно улыбались. Я также отвечаю за разработку и актуализацию процессов. \r\nПосле работы я занимаюсь собаками, слушаю музыку, хожу на природу или занимаюсь крав-магой.','https://www.linkedin.com/in/tereza-birkov%C3%A1-13377aba/','Tereza Birková','Tereza Birková','Tereza Birková');
