INSERT INTO `acamar_web_workelipsecolumn` (`id`, `title`, `text`, `image_id`, `parent_id`)
VALUES
	(1,'Máme velkou a živou databázi kontaktů','Systémy nám hlásí, kdy komu končí projekt. Rychle dostaneme do firmy kontraktora i celý tým.\r\n\r\n\r\n\r\n\r\n',35,11),
	(2,'Dosáhneme za hranice České republiky','Najdeme odborníky do mezinárodních týmů. V Praze, ale taky v Evropě a mimo ni.\r\n\r\n',213,11),
	(3,'Jednáme na rovinu a zajímáme se','Naši kontraktoři nám říkají Acamarádi. Bez osobního přístupu to ani nejde.\r\n',24,11),
	(52,'We have a large database of active contacts','Our systems tell us when projects end and who’s going to be available.\r\nWe’ll quickly bring the contractor as well as the entire team to the company.',35,1166),
	(53,'We reach even beyond the borders of the Czech Republic','We’ll find experts for international teams.\r\nIn Prague, in Europe, or outside of it.\r\n\r\n',27,1166),
	(54,'We treat everybody fair and are interested in what we do','Our contractors call us Acamarians.\r\nPersonal approach is absolutely essential in this job.\r\n\r\n\r\n',24,1166),
	(55,'У нас большая база специалистов и фирм и она постоянно расширяется.','Системы сообщают нам, когда Ваша работа или Ваш проект подходит к концу. Мы быстро найдём в фирму сотрудника, который будет работать по контракту, а если вам нужно, то и целую команду.\r\n\r\n',35,1261),
	(56,'Мы сотрудничаем с фирмами и IT-профессионалами за пределами Чешской республики.','Мы найдём специалистов в международные компании\r\nВ Праге, а также в Европе и за её пределами.',27,1261),
	(57,'Мы ведём дела добросоветно и всегда интересуемся сотрудниками, заключившими с нами контракт','Специалисты, которые с нами сотрудничают, считают нас помощниками и даже друзьями.\r\nК каждому специалисту мы находим индивидуальный подход, без которого не представляем свою работу.',24,1261),
	(220,'We have a large database of active contacts','Our systems tell us when projects end and who’s going to be available.\r\nWe’ll quickly bring the contractor as well as the entire team to the company.',35,4148),
	(221,'We reach even beyond the borders of the Czech Republic','We’ll find experts for international teams.\r\nIn Prague, in Europe, or outside of it.\r\n\r\n',27,4148),
	(222,'We treat everybody fair and are interested in what we do','Our contractors call us Acamarians.\r\nPersonal approach is absolutely essential in this job.\r\n\r\n\r\n',24,4148),
	(238,'У нас большая база специалистов и фирм и она постоянно расширяется.','Системы сообщают нам, когда Ваша работа или Ваш проект подходит к концу. Мы быстро найдём в фирму сотрудника, который будет работать по контракту, а если вам нужно, то и целую команду.\r\n\r\n',35,4516),
	(239,'Мы сотрудничаем с фирмами и IT-профессионалами за пределами Чешской республики.','Мы найдём специалистов в международные компании\r\nВ Праге, а также в Европе и за её пределами.',27,4516),
	(240,'Мы ведём дела добросоветно и всегда интересуемся сотрудниками, заключившими с нами контракт','Специалисты, которые с нами сотрудничают, считают нас помощниками и даже друзьями.\r\nК каждому специалисту мы находим индивидуальный подход, без которого не представляем свою работу.',24,4516),
	(247,'Máme velkou a živou databázi kontaktů','Systémy nám hlásí, kdy komu končí projekt. Rychle dostaneme do firmy kontraktora i celý tým.\r\n\r\n\r\n\r\n\r\n',35,4986),
	(248,'Dosáhneme za hranice České republiky','Najdeme odborníky do mezinárodních týmů. V Praze, ale taky v Evropě a mimo ni.\r\n\r\n',213,4986),
	(249,'Jednáme na rovinu a zajímáme se','Naši kontraktoři nám říkají Acamarádi. Bez osobního přístupu to ani nejde.\r\n',24,4986);
